INSERT INTO `astronomi` VALUES (1,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Baihaqi yang sedang berada pada lintang&nbsp; </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">Ï•=</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">+27</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">o</span></span></span></sup><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> ingin melihat sebuah bintang yang memiliki RA= 12</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><sup>h</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">30</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><sup>m</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">. Jika Baihaqi ingin melihat bintang tersebut berada pada koordinat horizon </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">(a=</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">27</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">o</span></span></span></sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">, Az=</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">123</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">o</span></span></span></sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">)</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> dan Baihaqi akan melihat bintang tersebut pada tanggal 13 Juli, maka pada jam berapakah Baihaqi bisa melihat bintang tersebut. Kemudian perjuangan Baihaqi tidak selesai di sini, Baihaqi ingin mencari tahu koordinat ekliptika serta koordinat galaktik dari bintang yang telah diamatinya. Bantu Baihaqi menentukan koordinat ekliptika serta koordinat galaktik.</span></span></span></p>','','','','','',1,'essay'),(2,'<p><img alt=\"\" src=\"https://i.ibb.co/DgKK3Vb/astro2.png\" style=\"height:331px; width:331px\" /></p><p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Soal ini akan berorientasi pada cerita perjalanan anak kecil bernama Nura. Nura yang masih kecil selalu penasaran dengan sekelilingnya, tak terkecuali alam semesta</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">-</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">yang dianggapnya sedekat pohon di seberang rumah.&nbsp;&nbsp;</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">a. Pada suatu malam, Nura mencoba melakukan star tracking pada langit bagian Timur tanggal 21 Juni, dari hasil tracking-nya didapatkan hasil sebagai berikut</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Tentukan lintang Nura berada</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">b. Setelah itu, Nura mengetahui bahwa cahaya bintang yang ia amati terabsorsbi oleh atmosfer. Nura pun kemudian mengamati sebuah bintang, yang selanjutnya Ia beri nama Arun. Nura mengamati bintang Arun pada jarak zenith 30</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><sup>o</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> dengan magnitudo 2,2 dan pada jarak zenith 45</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><sup>o</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> bermagnitudo 2,5. Dari informasi ini, Tentukan magnitudo sebuah bintang (anggap saja namanya Naru) sebelum memasuki atmosfer jika diketahui bintang Naru memiliki magnitudo 2,0 pada jarak zenith 10</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><sup>o</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">.&nbsp;</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">c. Nura juga ingin mengetahui berapa tahun lagi bintang Arun dengan gerak diri 10,5&rdquo;/tahun berada pada jarak terdekat dengan Bumi. Nura pun mencari data-data pendukung lainnya seperti paralaks dan spektrum H</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> Balmer bintang tersebut. Didapatkan paralaks bintang tersebut sebesar 1,72&rdquo; serta spektrum H</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"> Balmer bintang tersebut sebesar 6560 </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">Angstrom</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">.</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">d. Setelah diamati, ternyata bintang Arun adalah sebuah sistem bintang ganda. Jika magnitudo bintang yang satu adalah 1,12. Maka tentukan magnitudo bintang yang lain. Gunakan magnitudo total dari poin b. Jika tidak berhasil menemukan jawaban pada poin b, gunakan magnitudo total 0,5</span></span></span></p><p style=\"margin-left:48px; text-align:justify\">&nbsp;</p>','','','','','',1,'essay'),(3,'<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Seorang wisatawan asing datang ke khatulistiwa pada hari vernal equinox. Saat matahari terbenam ia mulai mendaki di lereng utara gunung yang condong ke cakrawala dengan sudut 10&deg;. Dia melakukannya untuk melihat pusat piringan matahari di cakrawala dengan tepat dan terus menerus. Berapa lama dia akan berhasil melakukan ini jika dia dapat bergerak dengan kecepatan hingga 5 m/s? Relief yang mengelilingi gunung dan pembiasannya dapat diabaikan.</span></span></span></p>','','','','','',1,'essay'),(4,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Erling Haaland terdampar di sebuah pulau pada tanggal 23 September. Karena bingung apa yang harus ia lakuakan, Halland dengan cermat mengukur ketinggian gelombang air laut setiap jam. Ini data ditabulasikan dalam Tabel 1 di bawah ini.&nbsp;</span></span></span></li></ol><div style=\"margin-left:41px\"><table cellspacing=\"0\" style=\"border-collapse:collapse; border:none; width:552px\">	<tbody>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; width:138px\">			<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Jam</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; width:138px\">			<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Ketinggian(m)</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; width:138px\">			<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Jam&nbsp;</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; width:138px\">			<p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Ketinggian(m)</span></span></span></p>			</td>		</tr>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:bottom; wid