i asumsi penyederhanaan;</span></span></span></p><ul>	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Pasang surut HANYA disebabkan oleh tarikan gravitasi Bulan&nbsp;</span></span></span></li>	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Abaikan efek rotasi Bumi pada pasang surut.</span></span></span></li>	<li style=\"list-style-type:disc\"><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">Abaikan gesekan antara permukaan bumi dan air.</span></span></span></li></ul><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">a. Plot data yang diberikan.</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">b. Menggunakan plot, tentukan sudut Matahari-Bumi-Bulan.</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">c. Temukan tanggal Bulan Baru terdekat.</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\">(d) Kemudian Halland menjelajahi daerah pulau tersebut, ia pun tertarik untuk memasuki&nbsp; gua besar yang gelap,di dalam sana tidak ada petunjuk untuk mengetahui waktu hingga ia memiliki jadwal makan dan tidur yang tidak menentu. Alhasil, ketika dia kembali ke pantai, dia lupa waktu. Dia mulai mengukur lagi ketinggian air pasang. Namun, kali ini, ia juga sibuk dalam kegiatan lain seperti mengumpulkan makanan dan membuat rakit. Jadi datanya, seperti yang diberikan pada Tabel 2, diambil hanya secara sporadic(tidak full). Temukan tingginya pasang pada pukul 16:00 pada hari itu,&nbsp;</span></span></span></p><div><table cellspacing