INSERT INTO `biologi` VALUES (1,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Dua eksperimen berikut ini mencoba untuk mengetahui mekanisme kerja insulin. Pada eksperimen pertama, laju inisial ambilan glukosa pada sel kontrol dan sel yang diberi insulin diukur. Hasilnya ditunjukkan pada gambar 1. Pada eksperimen kedua, dilakukan pengukuran konsentrasi GLUT4 pada membran terfraksinasi dari sel kontrol dan sel yang diberi insulin, menggunakan assay cytochalasin B radioaktif. Hasilnya ditunjukkan pada tabel berikut.</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/S4hPNGqQrKoWKHo4fPhcyCjnwwWv7H7Io0cpqelVTBQqvpnGj7ZgTFBzpVhmskwBTYrp-9D2TwsN3WvInhMSPlK_i4bmzcPAIn2FnozAd41V4pOXdgTUv3wVoIgfLKLU49RZ8HI\" style=\"height:216.7808961868286; width:239px\" /></span></span></span></p><p>&nbsp;</p><div style=\"margin-left:54px\"><table cellspacing=\"0\" style=\"border-collapse:collapse; border:none; width:566px\">	<tbody>		<tr>			<td rowspan=\"2\" style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:165px\">			<p style=\"margin-left:9px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Fraksi membran</span></span></span></p>			</td>			<td colspan=\"2\" style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:199px\">			<p style=\"margin-left:9px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Bound </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sup>3</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">H-Cytochalasin B (cpm/mg protein)</span></span></span></p>			</td>		</tr>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:165px\">			<p style=\"margin-left:9px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sel kontrol (tanpa insulin)</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:199px\">			<p style=\"margin-left:9px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sel yang diberi insulin</span></span></span></p>			</td>		</tr>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:165px\">			<p style=\"margin-left:9px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Membran plasma</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:199px\">			<p style=\"margin-left:9px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">890</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:202px\">			<p style=\"margin-left:9px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">4480</span></span></span></p>			</td>		</tr>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:165px\">			<p style=\"margin-left:9px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Membran internal</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:199px\">			<p style=\"margin-left:9px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">4070</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:202px\">			<p style=\"margin-left:9px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">80</span></span></span></p>			</td>		</tr>	</tbody></table></div><p>&nbsp;</p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Transport glukosa melalui membran sel lebih besar jumlahnya jika densitas GLUT4 pada membran sel tinggi</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Setelah insulin berikatan pada reseptor, maka terjadi sintesis GLUT4 pada sel dalam jumlah besar</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Vmax GLUT4 meningkat setelah insulin berikatan pada reseptor sel</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Km dari GLUT4 bernilai sekitar 10 mM</span></span></span></p>','1','0','0','0',1),(2,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sel liver mensekresikan protein dengan spektrum luas ke dalam darah via constitutive pathway. Anda tertarik pada bagaimana mekanisme protein-protein berbeda tadi disekresikan. Anda mencoba menambahkan 35S-metionin pada kultur sel liver pada waktu yang berbeda-beda untuk mengukur kemunculan protein yang terlabel (Gambar 1). Anda juga melakukan eksperimen lanjutan dengan menginkubasi sel selama 4 jam hingga terjadi distribusi yang steady state antara protein terlabel dan protein tak terlabel. Anda kemudian menghomogenisasi sel untuk memecah RE dan golgi menjadi vesikel dan dipisahkan berdasarkan densitas gradien sukrosa. Anda mengukur jumlah albumin dan transferin terlabel yang berasosiasi dengan dua jenis vesikel tadi (Gambar 2)</span></span></span></li></ol><p>&nbsp;</p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/RUBhbYuvLkHEJwilL8e0xVpZtarJqaibqJYGqscf8rggP6rvXZniEn8XGTKHy7l2YJojGIPAcameJg29j_g11PbwP9h_D1R56DqvE644qnYx39iPcdo4z9I0hxdMeNVUjNhe_M0\" style=\"height:195.98185873031616; width:277px\" /></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/YN6-W6Z-9CD_Xuhwhq1T6rZZ1HaU0B5wGFgGh8kLDpi50WCbXKnpehKVysk2m3R_GmxOhKtap_apXn2yio3U7VG6X3-PNJUtcx6vkXhBLzkE57mJO1hptgO-PADSbdsv9QrVG3A\" style=\"height:228.98334646224976; width:220px\" /></span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah.</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Onset sekresi albumin oleh sel liver relatif lebih awal dibandingkan dengan retinol-binding protein</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&lsquo;Slow step&rsquo; pergerakan protein albumin utamanya berlangsung di retikulum endoplasma</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Protein albumin disintesis oleh ribosom bebas</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Densitas retikulum endoplasma lebih besar dibandingkan dengan badan golgi</span></span></span></p>','1','0','0','1',1),(3,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sebuah segmen dari Moloney murine sarcoma virus mengangkut </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>enhancer</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> ekspresi gen yang memberikan sifat responsif glukokortikoid terhadap gen yang tergabung. Gambar di bawah menunjukkan aktivitas gen reporter (</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>chlorampenicol acetyl transferase, </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Cat</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>)</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> setelah transfeksi pada kedua </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>cell lines</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> dalam perlakuan dengan dan tanpa dexamethasone (senyawa glukokortikoid). Peneliti bingung dengan hasil yang didapatkan pada </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>cell line 1</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> karena </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>enhancer </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">viral meningkatkan ekspresi Cat 20 kali lipat walaupun tidak ada dexamethasone pada medium.</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/p4ZudcjtFrpz4kGpalOtKMu5hsl1t4IFdVOVMl_Q0giMwFDCHhR82G0aN3_zsTEnVIyha6sBhIP3ZHEZFGzLwSo22J81dnMHUq1PXBjWrYSbrziUYH1vQAek_jI6DlUmSH2by5s\" style=\"height:134px; width:484px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Keterangan gambar : + (ada dexamethasone), - (tidak ada dexamethasone). Angka menunjukkan tingkat ekspresi produk gen Cat. Pada semua kasus, nilai tingkat ekspresi yang didapat relatif pada konstruksi gen tanpa </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>enhancer </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">viral.</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tiap </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>cell line </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">mengandung reseptor glukokortikoid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perbedaan aktivitas Cat pada </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>cell line 1 </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">dan 2 setelah transfeksi pada perlakuan tanpa dexamethasone terjadi karena induksi oleh sekuen regulator virus</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Transkripsi Moloney Murine sarcoma virus bersifat indusibel oleh glukokortikoid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>enhancer </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">diletakkan di depan gen Cat, enhancer tidak dapat berfungsi</span></span></span></p>','1','1','1','0',1),(4,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Untuk meneliti mekanisme molekuler saat elemen regulator </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Tra2</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> (TGEs) mengontrol translasi, anda menginjeksi mRNA </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Tra2</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> ke oosit </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Xenopus</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> dan mengikuti nasibnya. Anda sudah menunjukkan sebuah protein oosit yang berikatan dengan TGEs akan menghambat translasi mRNA </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Tra2 </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;yang diinjeksi. Sekarang, anda akan meneliti bagaimana mRNA dengan protein terikat dapat memiliki ekor poli-A pendek. Untuk menjawab pertanyaan tersebut, anda menyiapkan dua jenis mRNA </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Tra2 </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">yang diberi radiolabel : satu dengan pasangan elemen TGE yang normal, dan satunya lagi dengan elemen TGE yang dihapus </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>(lihat gambar A)</strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">. Tiap RNA memiliki ekor yang tersusun atas nukleotida yang tersusun atas 65A. Anda menginjeksikan mRNA ke satu sel embrio </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Xenopus </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">dan mengisolasi mRNA kembali pada berbagai tahapan selanjutnya. Isolat RNA dengan radiolabel dianalisis menggunakan elektroforesis dan autoradiografi (</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Gambar B</strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">)</span></span></span></li></ol><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"Graphical user interfaceDescription automatically generated with low confidence\" src=\"https://lh3.googleusercontent.com/fthMPbAYqiTAFNIvsUFFMbkcNaI4_8MR49nZOtZVxafCrFBmu3aKJhlASOqXJLUFHWWpnl1rXjSl6nkkEuMXKD5JaoXtBC6JXDtsxgeGff67Z7QPEvXT4svKQ2rr3Jf37VRxXIg\" style=\"height:222px; width:624px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Ket gambar B. Injeksi mRNA ber radiolabel dengan dan tanpa TGEs ke sel embryo uniseluler </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Xenopus. </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Panjang poly a-tail tertera pada sisi kiri gambar. Jumlah sel merujuk pada jumlah sel embrio ketika embrio dipanen.</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">TGE mengubah stabilitas mRNA secara menyeluruh</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">mRNA lebih cepat terdegradasi jika tidak ada TGE</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">TGE memengaruhi panjang poly-a tails</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">GLD1 memengaruhi efisiensi translasi mRNA</span></span></span></p>','0','0','0','1',1),(5,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Langkah pertama yang dilakukan pada studi biosintesis glikoprotein sekretori tertentu adalah fraksinasi ekstrak kasar RNA menggunakan kolom oligo-dT. RNA yang berikatan pada kolom dielusi dan ditranslasi secara </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>in vitro </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">pada medium yang mengandung [</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sup>3</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">H] leusin dan [</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sup>14</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">C] manosa. Sebuah antibodi spesifik untuk glikoprotein sekretori ditambahkan dan hasil berupa imunopresipitasi dianalisis dengan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>sodium dodecyl sulfate </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">(SDS) Elektroforesis gel poliakrilamid. Distribusi dari radioaktivitas sebagai fungsi posisi pada gel elektroforesis dianalisis dan didapatkan hasil seperti pada </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>gambar 1</strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">. percobaan translasi </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>in vitro</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> diulangi pada keberadaan mikrosom kasar yang kemudian dilarutkan. Imunopresipitasi dan elektroforesis dilakukan dengan metode seperti percobaan sebelumnya dan didapatkan hasil seperti pada </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>gambar 2.</strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;</span></span></span></li></ol><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/1jSblkL5HAS4PTycFW3sJ95ObbUEx1poR43mC2Nra0a24y5hO58lKaaq0PP6vxZovZ23EZdBxXgUWbv_EJsjW0_zKMkgEGhmkFWnHPGLwgtKHHDBWTWeeQJKxT6fmkdPtDEmqtE\" style=\"height:192px; width:287px\" /></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/jbIPq3fKaqdDqkdinr1LxooWh5j0vBVmkt9r0bfXNG9JJ3bjp6KL-8AKO9EyTIL6RiAtboZZlcrJeFv2Z12EAr9Zd7aJZKETrAkyvPz6qAeTHrKtfhV8YQpVBdYJ8Q73rZ5Ngxs\" style=\"height:208px; width:300px\" /></span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Protein pada puncak </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sup>3</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">H di posisi 20 pada gambar 2 memiliki berat molekul monomerik yang lebih rendah daripada protein pada gambar 1. Hal ini menunjukkan jika mikrosom menyebabkan proteolisis tetapi hanya satu dari produk proteolisis yang terlihat pada gel di gambar 2. Produk proteolisis kedua tidak ada. Tentukan pernyataan berikut benar/salah mengenai produk proteolisis kedua berdasarkan soal di atas</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Produk proteolisis tersebut tidak dikenali antiserum</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Produk proteolisis yang tidak terlihat tidak mengandung residu leusin/ manosa</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Produk proteolisis tersebut berikatan namun tidak dilepaskan kolom oligo-dT</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Produk proteolisis tersebut cepat terdegradasi</span></span></span></p>','1','1','0','1',1),(6,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Freeze Fracture Electron Micrograph</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> menghasilkan gambar </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>tight junction </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;yang bagus. Anda ingin melihat apakah penghubung di </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>tight junction </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">benar benar statis seperti yang terlihat pada gambar. Dengan memfusikan gen </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Green Fluorescent Protein (GFP) </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">dengan gen claudin-1, anda dapat mengekspresikan sebuah fusi protein dimana ekor sitoplasmik dari claudin-1 tertandai dengan GFP. ketika anda mentransfeksi fusi gen ke sel L tikus yang tidak mengekspresikan claudin-nya sendiri, benang fluoresen terlihat di permukaan sel dimana sel-sel tersebut saling bersinggungan satu sama lain. Menjaga fokus pada sel yang sedang bergerak dalam waktu yang lama pada percobaan ini sulit dilakukan, namun anda dapat mengamati sel tersebut dengan jelas dalam waktu 40-50 menit. </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Gambar (A) dan (B)</strong></span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/oF0nqfT6NWHCsrBqK6K36D3vXQR9ONILuub4j_SW7KfRt3YgXRl46Jj1_IJsPqcjxOWs_foyMdMALK7hth0zm0xRWTcTQfyX65mm2hGjuuGjxTuVZbKzaFF7A0I20WH-CFiH53Q\" style=\"height:371px; width:392px\" /></span></span></span></p><p style=\"margin-left:48px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Keterangan gambar: Perilaku dinamis benang claudin di dekat membran plasma dari </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>A. </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">video klip 1 dan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>B. </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">video klip 2</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Helai benang pada gambar memanjang dan memendek dengan cepat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Helai benang pada gambar saling bergabung di ujungnya</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Ujung benang yang bergabung dengan sisi samping benang lain membentuk t- junction</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Keberadaan GFP di C-terminal mencegah claudin-1 berikatan dengan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>scaffolding </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">protein melalui domain PDZ (domain pengenalan motif asam amino pendek) pada protein tersebut</span></span></span></p>','0','1','1','1',1),(7,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada suatu eksperimen terdahulu terkait model kemiosmotik, pembentukan ATP dinilai menggunakan suspensi vesikel tilakoid (permukaan stromal menghadap ke luar). Vesikel ini dilakukan pengasaman dengan HCl atau dengan suksinat hingga pH = 4 , lalu dialkalinasi dengan keberadaan ADP dan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sup>32</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">PO</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sub>4</sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">. Hasilnya ditunjukkan pada gambar 1 dan 2.</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/9d0kplBZduILSiJl0GrsmJUlwrbd7dwID80nH3U4MAgz5m0NGGFaFhlxu_S9X6fSGhZmAEe6D-msc-Kq_s880gxm1ljZEiBR43abxjy-_XE4SanfzBFZdtLgL218rc8WQvCmPjc\" style=\"height:218.99835419654846; width:245px\" /></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/j_Cyi-OJ8iHOBmELLElK9cpjL94nOcSaZq5XqBuFXozn2E764Prdx1_egxXxng1ota88LihUKFx2KtWFwzRMef2oyOX7osMdxsmgUyfKLOIJMWkybFD9_lMEQnCWC_zZsMWgFYA\" style=\"height:221.99943351745605; width:264px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Ketika pH = 4, HCl kurang efektif meningkatkan sintesis ATP karena tidak permeabel melewati membran luar mitokondria</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Semakin tinggi pH alkaline, maka gradien elektrokimiawi semakin besar</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Penambahan FCCP (uncoupler) dapat menurunkan sintesis ATP</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Penambahan DCMU (block electron transport) dapat mengganggu gradien proton elektrokimiawi</span></span></span></p>','0','1','1','0',1),(8,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Anda mempelajari sintesis protein Tetrahymena, yang merupakan siliata uniseluler. Anda mendapatkan sejumlah sekuens data C-terminus protein Tetrahymena di bawah</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/5xa8bUembYm-pmVt5DVuSU1e-D1UXcrI7j_lb4af7fR0nzdxLPFuhRELbGxDET_xFCJcR-WuLdrUriXmA0ErkKH3JuRMTqB4EX06qI0dZOXLvCloiTgnJyO2Ozqd8wZQYuifVxo\" style=\"height:54px; width:557px\" /></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Namun, ketika Anda mencoba mentranslasi mRNA Tetrahymena pada lisat retikulosit yang merupakan sistem standar untuk analisis sintesis protein invitro, tetapi hasil produk translasinya ternyata menghasilkan polipeptida yang pendek-pendek (Gambar A, lane 1). Untuk mengetahui apa yang salah, Anda mencoba untuk melakukan eksperimen dari mRNA murni tobacco mosaic virus (TMV) yang mengkode protein 116-kd. mRNA TMV yang ditranslasikan menunjukkan hasil yang baik-baik saja di sistem invitro, dengan pita mayor 116-kd (sesuai prediksi), dan pita yang sangat minor sekitar 50-kd (Gambar, lane 2). Ketika RNA Tetrahymena ditambahkan, ternyata ada penurunan kecil dari dua pita, dan peningkatan signifikan pada satu pita yang lebih besar (lane 3). Ketika sejumlah sitoplasma Tetrahymena (minus ribosom) ditambahkan, mRNA TMV sekarang menunjukkan hasil dengan massa molekular lebih besar (lane 4). Lebih lanjut lagi, mRNA Tetrahymena yang sebelumnya inaktif sekarang tampak ditranslasi (lane 4). Anda mengkonfirmasinya ketika menghilangkan mRNA TMV (lane 5).</span></span></span></p><p><br />&nbsp;</p><p style=\"margin-left:48px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/NoOwpsrRShdM_LyJYNP4PKUJgiM3tWZOcYe8jeceyfpXTKAWtt-bZWTgFmp0t-t8ZNGSil2ur6_CccyK1O2NOhynDamyyEgWcTTjZHwlUQ6eTsB1IBjaw1YllMQBjuhRWkMxbOw\" style=\"height:368.9999055862427; width:222px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sekuens data protein Tetrahymena di atas yang berbeda dengan kebanyakan organisme adalah asam amino yang dikode UAG dan UAA</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tetrahymena mRNA hanya efektif ditranslasi jika diberi penambahan sitoplasma Tetrahymena</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Protein murni TMV sekitar 160 kD kemungkinan berasal dari penambahan asam amino yang seharusnya merupakan kodon stop pada sistem translasi retikulosit</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">tRNA sintetase Tetrahymena tidak dapat di-charge oleh lisat retikulosit, dapat dilihat dengan membandingkan lane 2 dan 3</span></span></span></p>','1','1','1','0',1),(9,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Anda mengekstrak semua protein pada sel kontrol dan sel yang diberi perlakuan, lalu dipisah menggunakan elektroforesis gel 2 dimensi. Umumnya ada ratusan atau ribuan spot protein yang terbentuk, lalu dibandingkan antara sel kontrol dan yang diberi perlakuan. Pada ilustrasi berikut ini hanya sedikit spot protein yang ditunjukkan untuk menyederhanakan visual. Protein dipisahkan pada dimensi pertama berdasarkan muatan isoelektrik (pH 4-10) dan dipisahkan berdasarkan ukuran menggunakan elektroforesis gel SDS-Poliakrilamid.&nbsp; Protein dideteksi dengan pewarna Coomassie blue dan diberi nomor untuk identifikasi</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Eksperimen pertama: Sel yang diberi perlakuan dengan obat (+drug) atau tidak diberi obat (kontrol) diekstrak dan diseparasi dengan elektroforesis gel 2D.&nbsp; Hasilnya ditunjukkan pada gambar A.</span></span></span></p><p style=\"margin-left:48px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/xxwEIsiffrDpsG8KdhWAPexqe51ty0kJVklCERwFpqPIZqD_jPdgTMvJuWLOGQuHpm6r9chPeOdbxYBD-HvjHKdxsCueU53VApdKMZBX4jf4VksBi3ZvlqVl3RIwhtdumYGq6WM\" style=\"height:135px; width:256px\" /></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Eksperimen kedua: Lalu Anda mensuspek obat tadi menginduksi protein kinase, sehingga Anda mengulang eksperimen pertama dengan ditambah fosfat anorganik terlabel 32P. Pada eksperimen ini, gel 2D diekspos dengan x-ray film. Hasil film ditunjukkan pada gambar B.</span></span></span></p><p style=\"margin-left:48px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/iPLEtb2qhEggQ2Ccfz91ElcAvtqNjg1Xe9yRmLUsR3SoMM01jNr9iiP3aM5Bnxkd1bZEGt-eNrzqL8031iPbyqrGDxNCshF77JZGLkUznSTrrrXfl02FeFx9MEOSQapnd78_u4g\" style=\"height:116px; width:214px\" /></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Eksperimen ketiga: Untuk menentukan lokalisasi seluler protein 1-7, maka sel dari eksperimen pertama dipisahkan menjadi fraksi nuklear dan sitoplasmik berdasarkan sentrifugasi diferensial. Gel 2D dijalankan, dan diwarnai, hasilnya ditunjukkan pada gambar C.</span></span></span></p><p style=\"margin-left:48px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/8zX-pmbP0agF1i-xbjupsMUXJJpxNu97emcZeqlyhOYG_IG9uy6giMlHtN5v35tB4PXLx7dBYJkn4-Jr1hxREE8AxekRV6_CWID3UElHHLaCB5ZeZh70x00_zT-iP3DrRmJNl0k\" style=\"height:285px; width:232px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Protein 4 terinduksi setelah diberi obat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Protein 2 merupakan fosfoprotein yang kadarnya tidak berubah setelah diberi obat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Protein 7 merupakan protein sitoplasmik yang bermigrasi ke nukleus setelah diberi obat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Protein 3 merupakan fosfoprotein sitoplasmik yang kadarnya tidak berubah setelah diberi obat</span></span></span></p>','1','0','1','1',1),(10,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Fungsi dari mikrotubulus bergantung pada pengorganisasian spasial spesifik di dalam sel. Anda mempelajari assembly in vitro dari dimer &alpha;&beta;-tubulin menjadi mikrotubulus. Hasilnya ditunjukkan pada gambar 1. Ketika sentrosom ditambahkan pada larutan tubulin, hasilnya menjadi gambar 2. Diketahui bahwa assay berbeda digunakan pada dua eksperimen tersebut.</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/jAhMMuYwbzg9EHnDs4maCwfGbHsJaTdCp4h1tMPcezPHSH1QP-ILR7gDSkG3llgSQooc3HYmVXq0-1topkr9F3R-8JIJWpMB6cqamRBC35b8ME6Fyw8w1GgndjXSC4c7Uzi71Bs\" style=\"height:168px; width:466px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Diketahui bahwa konsentrasi dimer &alpha;&beta;-tubulin pada sel tipikal adalah 1 mg/mL, dengan berat molekul dimer tubulin 110.000</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sentrosom meningkatkan konsentrasi kritikal untuk polimerisasi mikrotubulus</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada grafik (A), semakin tinggi dimer &alpha;&beta;-tubulin, maka grafik akan mencapai plateau</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Konsentrasi dimer tubulin di dalam sel sebesar 9,1 mM</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Nilai konsentrasi dimer tubulin di dalam sel berada di atas nilai kritikal konsentrasi yang dibutuhkan assembly mikrotubulus tanpa sentromer.</span></span></span></p>','0','0','0','0',1),(11,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Anda melakukan penelitian RNA editing untuk mempelajari ekspresi gen organel pada perkembangan tanaman kedelai. Anda membuat mutan kedelai dari gen yellow leaf (yl) lalu dibandingkan fenotipenya dengan wild type. Hasilnya ditunjukkan di bawah ini</span></span></span></p><p><br />&nbsp;</p><p style=\"margin-left:48px; text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/6FS8BxDKT5lKCVTMuniJmjhVIOa0bNstVrYhD_d7uiC8emzZ8kr3fw8z-3EZXf7r8ysYdJtagIMIJ-p5nlGljzCUYr86iHjD50AC6QCEy5Rbn5FswPE6QJgtg95qhKp7mh6PLa8\" style=\"height:426px; width:463px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gambar: (A) tanaman usia 2 minggu wild type (kiri) dan yl (kanan). (B) konten klorofil pada daun ketiga wild type (kiri) dan yl (kanan). (C) efisiensi maksimum fotokimia fotosistem 2 (PSII) diukur dengan rasio fluoresensi klorofil Fv/Fm;</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Proses pembuatan tanaman mutan di atas merupakan suatu modifikasi post-translational</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Mutan YL kemungkinan memiliki gangguan dalam reduksi NADP+ selama proses fotosintesis</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Rasio klorofil a/klorofil b pada mutan lebih tinggi dibandingkan wild type</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Untuk mengetahui ekspresi gen YL pada berbagai jaringan tanaman, Anda lebih baik memilih menggunakan fusi protein YL-GFP (green fluorescence protein)</span></span></span></p>','0','0','1','0',1),(12,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sitokinin adalah kelas hormon tanaman yang berperan sentral dalam siklus sel dan mempengaruhi banyak program perkembangan tanaman. Namun, peran regulatori sitokinin masih belum banyak diketahui. Pada penelitian ini, Anda merekayasa secara genetika ekspresi sitokinin oksidase pada tanaman tembakau transgenik yang disisipi gen AtCKX1 atau AtCKX2. AtCKX merupakan gen enzim sitokinin oksidase untuk metabolisme sitokinin.</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:57px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/nZ7WxYeh02dgBdSGGAyh5WKr8HZLpZ38Vufos74qITCGxbI_M409R8jDc1KcboMuzZha_OJJOnCsjXvxzQP1U-4Ez_Jsy6ZmWUwBqw1Xv2BpcUItMDqOsq9INlTA7sYH8O-vQPM\" style=\"height:361px; width:509px\" /></span></span></span></p><p style=\"margin-left:47px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gambar: fenotipe tanaman tembakau yang mengekspresikan AtCKX1 maupun AtCKX2. (A) Tampilan atas tanaman usia 6 minggu, (B) Tanaman tembakau pada saat berbunga, (C) Kinetika pemanjangan batang. Tanda panah menandakan onset pembungaan. Angka di atas panah menunjukkan usia tanaman (hari, setelah germinasi) dan jumlah daun pada tahapan tersebut. Bars = SD; n=12. (D) perbandingan ukuran daun dan senesens.</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tanaman transgenik memiliki jumlah bunga yang lebih sedikit dibanding wild type</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Width-to-length ratio dari daun dewasa berkurang pada tanaman transgenik dibandingkan wild type</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Klorosis tanaman transgenik terjadi terutama pada area di sekitar vena daun</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jumlah daun merupakan determinan pada induksi pembungaan tanaman tembakau</span></span></span></p>','1','1','0','1',1),(13,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Nitrogen (N) merupakan nutrien esensial yang mempengaruhi proses pembungaan. Kadar N rendah mempercepat transisi bunga. Namun, mekanisme molekuler respon tersebut belum diteliti. Pada penelitian ini, Anda meneliti faktor transkripsi FLOWERING BHLH (FBH4) sebagai regulator kunci pembungaan yang responsif terhadap N pada tumbuhan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Arabidopsis.</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> Hasil penelitian ditunjukkan pada gambar di bawah.</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/uhzZP6T5CPtq8L4ySAiND8aHe1y-Zs4xIJNUucOERUT-BwAmgLLRDCe6FnrgC2E44wi4Ot7OZhGXbxjATCBPzLo1IQi4sSSyjWiApY8D5eLLuisl6NnBZ8n7j4V00fMOh_sXKhQ\" style=\"height:214px; width:428px\" /></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/X3zlJ-dhoC5kVE4SWP0ayFGMV-Odb8oEkS2cnx75JYmy01cj230zpyG93mRS4FLUELAelhKFIH3ab8EVNsCuTMmnZawm2U4k7OdQcfwwO3BJQxvzhcgbSb7nVqWHgC40zj37PFs\" style=\"height:178px; width:485px\" /></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gambar : </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>A.</strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> Analisis Phos-tag SDS-PAGE dari FBH4 dalam keadaan terfosforilasi. Protein total diekstrak dari tumbuhan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>wild type </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">(WT) dan mutan overekspresi FLAG-FBH4. Protein total kemudian ditumbuhkan pada cawan kontrol berisi 30 mM N dan di imunopresipitasi dengan butiran antibodi anti-FLAG. Setelah itu, WT dan mutan diinkubasi dengan (+) dan tanpa (-) </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>lambda phosphate </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">(&lambda;PP). Protein FLAG-FBH4 yang telah dimurnikan dipisahkan dengan standar (bawah) atau Phos-tag SDS-PAGE (atas) dan dilanjutkan dengan analisis </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>immunoblot</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> menggunakan antibodi anti-FLAG. </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>B.</strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> Gambar representatif tumbuhan WT dan mutan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>fbh1/2/3/4 quadruple mutant</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> (fbh qd) yang ditumbuhkan pada larutan hidroponik mengandung 3 mM N (H) [1 mM KNO</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sub>3 </sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">+ 1 mM NH</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sub>4 </sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">NO</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sub>3</sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">], (H menunjukkan hidroponik) atau 0.3 mM N (H) (0.1 mM KNO</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sub>3 </sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">+0.1 mM NH</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sub>4 </sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">NO</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sub>3</sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">) Gambar diambil ketika tumbuhan berumur 25 hari. </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>C dan D. </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Grafik laju pembungaan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>D. </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">menunjukkan waktu yang dibutuhkan untuk berbunga pada tumbuhan mutan fbh qd dan wt.</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Protein FLAG-FBH4 mengalami multi fosforilasi</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">FBH4 tidak terfosforilasi pada </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Arabidopsis </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">yang ditumbuhkan pada kondisi normal (terdapat N dan fosfat)</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tumbuhan mutan fbh-qd tidak merespon kadar N rendah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Keempat protein FBH berperan dalam percepatan pembungaan pada konsentrasi N rendah</span></span></span></p>','1','0','0','1',1),(14,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Penggunaan fungisida berbahan dasar tembaga (Cu) menyebabkan Cu terakumulasi dalam tanah. Konsentrasi Cu melebihi batas aman pada tanah dapat menyebabkan keracunan pada tumbuhan. Keracunan Cu menyebabkan ketidakseimbangan asupan nutrien sehingga menghambat pertumbuhan. Feil dkk. Menggunakan tanaman mentimun yang ditumbuhkan secara hidroponik untuk meneliti pengaruh paparan Cu dalam berbagai konsentrasi. Hasil yang didapatkan dari penelitian tersebut dijelaskan pada gambar di bawah.</span></span></span></li></ol><p>&nbsp;</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/I7FRiy54JJXiK1N1PSi12hADx005nvJiSMlwp4Vo12Kok97EijTQzxL2AC1BEWA3dhQuWc0tYwndF_mYI053CIbSzygQWpyQJo5YzIT1eDhJENQrrwkhUCTKZLFYNkWorhLU0cY\" style=\"height:306px; width:459px\" /></span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gambar : </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>A. </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pertumbuhan tunas pada tumbuhan mentimun yang diberi Cu pada konsentrasi&nbsp; 0.2,5,25, dan 50 &micro;M. </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>B-E. </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sistem akar tumbuhan yang ditumbuhkan dengan Cu masing-masing pada kadar&nbsp; 0.2,5,25, dan 50 &micro;M.</span></span></span></p><p><br />&nbsp;</p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Tabel 1</strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">. Biomassa akar dan Tunas Serta Indeks SPAD klorofil pada Tumbuhan Mentimun 7 Hari Setelah perlakuan. Huruf yang berbeda menunukkan nilai yang berbeda nyata secara statistik</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/0DTJ7zgdI0_jrdjtGo8RX-EeLzzC_9NAjZIaypZ6NGIye60tYytt3mu1bHYdgoS_B6vZqJo6U9k9vHGBCAMPWVJjbMhy0UDb2bUa9QdgJr6HXP58-2hEHbz-Fdj-8MQ9erlwwU4\" style=\"height:80px; width:624px\" /></span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tumbuhan mentimun yang tumbuh pada konsentrasi Cu 50&mu;L mengalami klorosis</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perubahan bentuk sistem akar menyebabkan biomassa akar berkurang</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Semakin tinggi konsentrasi Cu, aktivitas fotosintesis semakin berkurang sehingga daun tumbuhan mentimun mengkompensasi pengurangan aktivitas fotosintesis</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Toksisitas Cu mengganggu translokasi nutrien dari akar ke tunas</span></span></span></p>','0','1','1','1',1),(15,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perhatikan dua gambar sayatan melintang tumbuhan di bawah ini.&nbsp;</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"A picture containing textDescription automatically generated\" src=\"https://lh5.googleusercontent.com/Xu40jEPUIIXbuwjNma56MFZS_PP-kehx86uTVZaxhHjc258MWhDN6OjXqhrILGV1L3QbGheLOPMcDbkqRH9TByrFHDdC8pNn-F_Sl1epVDnNNrPFkjgyWGZJ-pwZpvtVxcG7HxI\" style=\"height:224px; width:575px\" /></span></span></span></p><p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kedua gambar sama-sama menunjukkan organ daun tumbuhan yang hidup di air.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kedua tumbuhan adalah monokotil.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada gambar 1, dapat teramati astrosklereid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada gambar 2, a adalah sel hasil modifikasi suatu jaringan hidup. Selain termodifikasi menjadi a, jaringan ini juga dapat termodifikasi menjadi sel-sel yang melakukan fotosintesis</span></span></span></p>','1','0','1','1',1),(16,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perhatikan dua gambar sayatan melintang bunga di bawah ini.</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"A picture containing text, transport, chain, wheelDescription automatically generated\" src=\"https://lh6.googleusercontent.com/gyQc-_m5nzaLkXnOhdReAJGfDKh20yCYmJwkGTmZBTYYvoqF0h-575DqFpZ5kPDZPV5isv4h9I9F9iYFDIiD6yUmb0Fu0VJ-PzH-ho8blYr_F-oEoXA6J7CqDdfyuKQdpWUNHvY\" style=\"height:263px; width:570px\" /></span></span></span></p><p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat kelenjar sekretoris yang mengeluarkan nectar pada gambar 1</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Bunga di gambar 1 dan gambar 2 adalah bunga sempurna</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Bunga di gambar 1 memiliki empat karpel, sedangkan bunga di gambar 2 memiliki satu karpel</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Androecium biasanya tersusun atas filamen dan anther. Pada bunga di gambar 2, terdapat empat anther, yang mana masing-masing anther tersusun atas dua mikrosporangium</span></span></span></p>','1','1','1','0',1),(17,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Respon tumbuhan terhadap herbivora memicu resistensi dan melibatkan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Specific Herbivore-associated Molecular Patterns </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">(HAMPs). Namun, reseptor spesifik beserta molekul asing terkait pengenalan herbivora masih belum diteliti. Penelitian ini dilakukan untuk menunjukkan jika sebuah reseptor memberi sinyal dan respon pertahanan sebagai respon ke HAMP tertentu yang ada di sekresi oral ulat (OS). Tumbuhan secara spesifik merespon OS melalui inseptin, fragmen proteolitik dari ATP sintase kloroplas. Hasil penelitian didapatkan seperti pada gambar.&nbsp;</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/7V2iW-Ot5_Q1puypWohpJANZqGXIC_OwH1TBP-bJaO5HtNz2aUDHrWeRg3qPvcT0p1-LORQJLRSpmmOhnl28U3yT_3eZkcu8l8dWwR-d9Ynbj9H6-FGrd8LL43L-F1ex6w2RqrU\" style=\"height:322px; width:256px\" /></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Keterangan gambar : Mekanisme pengenalan herbivora pemakan daun dan induksi pertahanan dari molekul asing pada legum melalui INR (</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>corresponding leucine-rich repeat receptor)</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">.</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Serangan herbivora lebih dari sekali akan menstimulasi pengenalan Vu-In oleh INR</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">SOBIR1 dan SERK merupakan koreseptor yang fungsinya dipengaruhi INR</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Inseptin dapat memicu respon imun tumbuhan tanpa bantuan INR</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">ROS merupakan hasil dari mekanisme pengenalan herbivora yang dapat menekan laju pertumbuhan hama herbivora</span></span></span></p>','1','1','0','1',1),(18,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Perhatikan ilustrasi penderita kelainan jantung di bawah ini (kanan) vs jantung orang normal.</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh6.googleusercontent.com/QAdDjsr8w6B3xuYCUAfEBivShd9sJlS7W2TICzQsYsJvBqltcDeIugN04C0omKTJ-H3xuYVyAmQucDvh08ASlqMq93UaHQ2xTj1vYWUoNfbfJxehUJ7xV9qHLss8DVmF4eKoatc\" style=\"height:250px; width:390px\" /></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan-pernyataan berikut ini benar atau salah terkait kondisi penderita kelainan jantung bawaan di atas</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pengukuran saturasi oksigen di arteri radialis kanan akan menunjukkan hasil normal</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Aliran darah ke paru-paru lebih rendah dibandingkan dengan orang normal</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Ketika terjadi hipertensi paru, maka darah dari ventrikel kanan akan bocor ke ventrikel kiri</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika tidak ditangani, maka penderita dapat mengalami gagal jantung kiri ketika dewasa</span></span></span></p>','1','0','1','0',1),(19,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Insulin dihasilkan awalnya sebagai inaktif prekursor bernama preproinsulin, yang kemudian mengalami langkah-langkah pemrosesan proteolitik di bawah ini hingga menjadi insulin matur.</span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh4.googleusercontent.com/T2bdAQB4qEWhnv9_I1x6Oz0T-_thhGD8zsaOOpHO1lfB-E-CQtOKMVFLXa52Se4VS3w8zMIDe9A7NASvjvbuRFHmh_TUtsIv8wNUSo0UbnCNq5DlZijxE7gjqTRpIEvi7zM6LNs\" style=\"height:296px; width:410px\" /></span></span></span></p><p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Insulin matur merupakan modifikasi post-translasional dari proinsulin</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada individu diabetes mellitus tipe 1, sel T menghancurkan insulin matur yang dihasilkan sel sel beta pankreas</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Hasil pengukuran kadar peptida C yang lebih tinggi daripada normal, mengindikasikan diabetes mellitus tipe 2, bukan tipe 1</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Penderita diabetes dengan gangguan gula darah puasa dapat diberi injeksi insulin rapid acting</span></span></span></p>','1','0','1','0',1),(20,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\">Stres oksidatif diketahui menjadi salah satu penyebab dari kerusakan ginjal. Suatu penelitian dilakukan untuk mengetahui efek H2 terhadap kerusakan ginjal yang diinduksi oleh chronic-intermittent hypoxia (CIH). Mencit dipisah menjadi empat kelompok: kontrol, CIH, CIH + H2, dan kontrol + H2. Kemudian dilakukan pemeriksaan histopatologi ginjal dan pengukuran kreatinin serum pada hari ke 0, 7, 14, 21, 28 dan 35. Hasilnya ditampilkan di bawah ini</span></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><span style=\"background-color:#ffffff\"><img src=\"https://lh6.googleusercontent.com/m78hHvIASKkyK8emtJQZujs9kDiz6xjr8azJRbiMDOpKNx_9zhMHwEsdm52vQHsZBwPgGh713AmYTn9phCWOowbNGuJGG3gE5O7z1Y8CJs32buCzbBHtUrqGeIVTz6lHyd2CWEI\" style=\"height:256px; width:602px\" /></span></span></span></span></p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">**p&lt;0,01 vs normoxia group, ## p&lt;0,01 vs CIH group</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Glomerulus dan tubulus ginjal mengalami edema pada ginjal mencit hipoksia</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kelompok mencit normoxia memiliki kreatinin serum yang lebih rendah dibandingkan pada kelompok hipoksia</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Hipoksia ginjal menyebabkan peningkatan glomerular filtration rate</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pemberian H2 pada mencit sehat bermanfaat untuk mencegah kerusakan ginjal akibat hipoksia</span></span></span></p>','1','1','0','0',1),(21,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">CD4 dan CD8 adalah sel T yang sangat berperan penting dalam sistem imunitas tubuh. Perhatikan ilustrasi di bawah ini yang menggambarkan interaksi kedua sel tersebut dengan sel-sel lain.</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"A picture containing shapeDescription automatically generated\" src=\"https://lh3.googleusercontent.com/t92oN8RZCQfJqpGYdXgS0XU83VTGW87b-eamh0jXcDwheJLAiRTaU6dYs0L5860gimiJ5kmVjjWK0UWGKgv518P7aS9eR3MKLJIyhy4fMrG8c4UYUNRVtAetgWlf6FKcXGT9SgM\" style=\"height:495.0959473848343; margin-top:-20px; width:373px\" /></span></span></span></p><p style=\"margin-left:24px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sel-sel yang memiliki B pasti memiliki A, tapi tidak sebaliknya</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">B menyajikan antigen yang diakibatkan oleh infeksi endogen, seperti misalnya infeksi oleh virus</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sel yang memiliki A kemungkinan dapat melakukan fagositosis dengan baik</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sel yang menyajikan antigen pada A akan dipicu melakukan apoptosis oleh sel T yang mendeteksinya</span></span></span></p>','0','1','1','0',1),(22,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sekelompok ilmuwan ingin mengetahui perbedaan mencit (atau mice, </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Mus musculus</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">) dan tikus (atau rat, </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Rattus rattus</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> dan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Ratus norvegicus</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">) dalam menoleransi keberadaan oksigen. Ilmuwan tersebut memaparkan kedua hewan pada keadaan hipoksia. Kemudian, kemampuan ventilasi dan keadaan hematologis diukur, lalu disajikan dalam grafik di bawah ini.</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"A picture containing chartDescription automatically generated\" src=\"https://lh6.googleusercontent.com/uL2YxLvEXR0K5QsKHXFLvoYWy8pFn-FTr7aTkXlQiVM1HBl0eGcR2qNRcvtZiQ3VtkBDuvv_eDzomPbr2b918Hshi8FLbOMuNkk7ck205mQMgPx0Ybd9BuO1Hap6vmMNthEsLzc\" style=\"height:404px; width:550px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Grafik 1. A) Ventilasi, B) Volume tidal, dan C) Frekuensi respirasi yang sudah disesuaikan dengan massa tubuh hewan.</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"A picture containing chartDescription automatically generated\" src=\"https://lh3.googleusercontent.com/8-mVTZGiG5aFRSUs2AB8HDxAXa9wvAfgW0h2kH5rJfjCbHbE59fM1_bR79iVoxmXSioj3RBFU80OJgB_2jgNyKPxt4AZ1FK6mQjjzU8TA9o7KfwFVqb3GtnVLBTLWsHL5LHEM9w\" style=\"height:278px; width:462px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Grafik 2. A) Hematokrit dan B) konsentrasi hemoglobin pada tikus dan mencit dalam normoxia serta hypoxia selama 6 jam, 1 hari, 7 hari, atau 21 hari.&nbsp;</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tikus memiliki kontrol pada sistem respirasi yang lebih plastis dibanding mencit</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Aklimasi secara hematologis lebih kuat dan dilakukan lebih cepat oleh tikus dibandingkan mencit</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pengukuran parameter kardiovaskular seperti laju detak jantung dan saturasi oksigen pada arteri sebenarnya dapat membantu penelitian ini mencapai konklusi yang lebih meyakinkan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Hasil pengukuran fisiologis pada penelitian ini mendukung hipotesis bahwa mencit berasal dari daerah Himalaya, sedangkan tikus berasal dari dataran rendah China dan India.</span></span></span></p>','0','1','1','1',1),(23,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gastrektomi adalah operasi pemotongan sebagian lambung. Prosedur medis ini banyak dilakukan untuk mengatasi masalah obesitas. Obesitas seringkali menyertai seseorang dengan diabetes mellitus tipe 2. Namun, efek jangka panjang gastrektomi masih belum banyak dipelajari. Penelitian ini mengukur kadar glukosa darah pada pasien yang telah melakukan gastrektomi, baik yang mengidap diabetes tipe 2 maupun tidak, satu dan tiga tahun setelah prosedur dilakukan.&nbsp;</span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Grafik 1. a) Perubahan rerata kadar glukosa darah setelah gastrektomi, b) Kadar HbA1c pada pasien pengidap diabetes. HbA1c adalah hemoglobin yang berikatan dengan gula.</span></span></span><img alt=\"ChartDescription automatically generated with medium confidence\" src=\"https://lh3.googleusercontent.com/M4EkTJq4edvOA3BKXeFGOzZAcbtT_LpaxCz5nZY8cQYxGDTVb_frusbsHeYSRWNnlsPx6E_ZrN6Uglh767Aum4v2CzRezVfAfZMGmDbtsjyJ64tghkS6Qg7einsvE_Ru5U4gjxg\" style=\"height:356px; width:823.6892700195312\" /></p><p><br /><br /><br /><br /><br /><br /><br /><br /><br /><br /><img alt=\"ChartDescription automatically generated with medium confidence\" src=\"https://lh3.googleusercontent.com/M4EkTJq4edvOA3BKXeFGOzZAcbtT_LpaxCz5nZY8cQYxGDTVb_frusbsHeYSRWNnlsPx6E_ZrN6Uglh767Aum4v2CzRezVfAfZMGmDbtsjyJ64tghkS6Qg7einsvE_Ru5U4gjxg\" style=\"height:394px; margin-left:-567px; width:910.8048298358917\" /><br />&nbsp;</p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Grafik 2. a) Jumlah pasien dengan diabetes mellitus yang mengalami peningkatan atau penurunan nilai glukosa. b) Jumlah Jumlah pasien tanpa diabetes mellitus yang mengalami peningkatan atau penurunan nilai glukosa.</span></span></span></p><p><br /><br /><br /><br /><br /><br /><br /><br />&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gastrektomi lebih efektif mengatasi diabetes mellitus dibanding terapi hormon insulin</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Rerata kadar glukosa setelah satu tahun sejak gastrektomi dilakukan pada pasien dengan diabetes mellitus menurun meskipun secara individu lebih dari 60 pasien mengalami peningkatan kadar glukosa</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gastrektomi dapat menurunkan berat tubuh dengan mempercepat seseorang merasa kenyang</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada dasarnya, pengukuran kadar HbA1c setelah tiga tahun gastrektomi dilakukan juga dapat mencerminkan kadar glukosa satu tahun sebelumnya</span></span></span></p>','0','0','1','0',1),(24,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gambar di bawah ini menunjukkan bentuk potensial aksi pada bagian jantung manusia</span></span></span></p><p>&nbsp;</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"IMG_256\" src=\"https://lh5.googleusercontent.com/Ugv-3gFQMkkD32ijIaoKulC3ILVh9b4wwAcpRSRRUL0fJU2PeayUc0Aeuv0dbz3QAuhzNqYzy-kf46n9BBEvz3i3f_M1OOUAUlQw-_ugZQLWDdRND8e6uhbEZuYOvO4qQDTSOSY\" style=\"height:309px; width:332px\" /></span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan apakah pernyataan berikut benar (B) atau salah (S)!</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Diagram potensial aksi tersebut dapat kita temui pada pacemaker jantung</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Proses nomor 2 terjadi karena adanya pergerakan ion Ca2+ keluar dari sel</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Amlodipin, sebuah obat yang bekerja dengan cara menghambat masuknya ion channel Kalsium akan membuat proses no 2 lebih landai</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Bagian jantung ini memiliki tidak memiliki periode refraktori</span></span></span></p>','0','0','0','0',1),(25,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kalsium adalah elemen kunci untuk berbagai proses faal. Tentukan pernyataan berikut benar atau salah terkait kontrol hormonal homeostasis kalsium</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Parathormon adalah hormon yang disintesis oleh kelenjar paratiroid. Sekresinya akan selalu meningkat seiring kadar ion kalsium di dalam darah meningkat</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Vitamin D menstimulasi sintesis parathormon</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kerja parathormon dapat diamati dari meningkatnya konsentrasi sirkulasi PO</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sub>4</sub></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sup>-3 </sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">akibat ekskresi ion tersebut oleh ginjal</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Hypercalcemia</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong> </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">disebabkan oleh adanya pelepasan Ca</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sup>2+</sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> yang berlebih dari tulang dan peningkatan absorpsi Ca</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><sup>2+ </sup></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">pada usus, lalu akan menstimulasi sekresi hormon kalsitonin</span></span></span></p>','0','0','0','1',1),(26,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gambar di bawah ini menunjukkan besar volume tidal dan volume residu fungsional. A menunjukkan kondisi normal&nbsp;</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Keterangan:</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">FEV(Forced Expiratory Volume): volume udara yang dapat diekspirasi dalam detik pertama ekspirasi maksimal</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">FVC (Forced Vital Capacity): volume udara yang dapat diekspirasi setelah inspirasi maksimal</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"Graphical user interfaceDescription automatically generated\" src=\"https://lh3.googleusercontent.com/NOCVOfYAQjoqAsIAEQnVFvPXTL4A83uUHiafOvs8cjiW15Ywq7mwUfo4_26qVBPtaK2Ep4U1lLLFuilHR2rJGf2GARA5nE2Z2wjwqF377agnDdd-3pOLCUgTq-A2VzjkHNiUcWw\" style=\"height:191.79263591766357; width:509px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">A</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; B</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"> &nbsp; &nbsp; &nbsp; C</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan apakah pernyataan berikut benar (B) atau salah (S)!</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Orang berpenyakit asma ditunjukkan oleh gambar C</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Orang berpenyakit cystic fibrosis ditunjukkan oleh gambar B</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Orang berpenyakit cystic fibrosis memiliki rasio FEV/FVC lebih tinggi dibanding orang berpenyakit asma</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Penyakit pneumonia akan memiliki gambar seperti C</span></span></span></p>','0','0','1','1',1),(27,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Di bawah ini merupakan gambar otot manusia di bawah mikroskop</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">A</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"IMG_256\" src=\"https://lh4.googleusercontent.com/kyCKlAlY--M5jRGOftUTM7ZbKuPam9Cp8NtGnxcqD3Ikz1txR3HVEPM8q8DdCjWifGt3FpOC-mqpUi3jpMHQr__DjwEm3qxdGIKrGyIWQKdnhDtSPK86SWP3VzGypP17BYVE7Sk\" style=\"height:128px; width:206px\" /></span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">B</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"IMG_256\" src=\"https://lh5.googleusercontent.com/QHtsSliv-x1eUUNagCk9cMtiKaro2zRFn1tUWxvE6wfrxidqEJ4q_Tp6881R6YWF-rkPnG4RyeaLeoa7zFj-C1Fx0nqjF-peQovSCMMtLhIrnRdIb01VqTN5Yf19E0aixkD0IK0\" style=\"height:136px; width:204px\" /></span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">C</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"IMG_256\" src=\"https://lh3.googleusercontent.com/DzuSpBgUDJ4iKJrIC9i4LxXrcfbDa0n6tnjDIahNDGn_5GoNK1gkVMzSlgeIE_dfXZxTL54xm9LHk-K-XwcwSZEoGR__kY_FODxgLwMX0gdCz1wdS5oiQD4wKU7f-hiWjTm5qdU\" style=\"height:152px; width:202px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan apakah pernyataan berikut benar (B) atau salah (S)!</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gambar B merupakan otot yang melapisi organ-organ pencernaan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Otot pada gambar A dan C bekerja secara voluntary</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Otot pada gambar A dan B memilki periode refraktori yang kurang lebih sama</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Otot pada gambar C dapat ditemukan pada rangka manusia</span></span></span></p>','0','0','1','1',1),(28,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Di bawah ini merupakan beberapa mekanisme mungkin terjadi di ginjal untuk sebuah zat di ginjal</span></span></span></p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"Diagram, schematicDescription automatically generated\" src=\"https://lh6.googleusercontent.com/RFdSBsRSMq0GuM-cebEcSRea61BAO-EK-81SV9uUuCxaHfkin_HEOE-IgnotVGHWrwVYbf5QPjT8gdd4qNDgCDgY0mSHj2_WpLh_1NolOp19JNfz3wZT5Y_n7HskxkUmwHZL0EA\" style=\"height:181px; width:318px\" /></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"Diagram, schematicDescription automatically generated\" src=\"https://lh4.googleusercontent.com/F5-BwIjYLceDyP05VrDWwDKyKntABvIkb5ykX01Ez8Q-C5t3lzznmI5VmKFIdJP1n_3q0U-KOmxELSpmWBBrYyqgXsf_SoNY1f-HyAShYnfyND-vfVrsouxx-KZWDJfRD6yJ_QI\" style=\"height:177px; width:312px\" /></span></span></span></p><p><br />&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan apakah pernyataan berikut benar (B) atau salah (S)!</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Contoh zat yang menggunakan mekanisme A adalah kreatinin</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Contoh zat yang menggunakan mekanisme B adalah zat-zat elektrolit</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Nutrisi penting seperti asam amino menggunakan mekanisme B</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Zat seperti asam dan basa organik menggunakan mekanisme D</span></span></span></p>','1','1','0','1',1),(29,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Neurotoxin mempengaruhi fungsi sistem saraf, sering kali dengan memodulasi aktivitas ion channel. Berikut ini ditunjukkan potensial aksi yang normal (kiri) dan yang dipaparkan berbagai toksin berbeda. Diketahui mekanisme kerja dari tetraethylammonium: memblok voltage-gated K channel; Batrachotoxin: memblok voltage-gated Na channel yang telah membuka; Tetrodotoxin: mengganggu pembukaan voltage-gated Na channel.</span></span></span></p><p><br /><br />&nbsp;</p><p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/jbJBxqWCnDkWtA3znlMMCoEwjFGZHM0oHBSKvPlFpHPD7vpgagDKWKHXJu4B6tj15nFNezcBtOjlQTQtrS0xur7-JcLVs64xTLg4JzDVE6d5aIxhVxJfDuhV5aSZoRlxjnEmbd4\" style=\"height:180px; width:556px\" /></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Grafik 1 menunjukkan pengaruh dari tetraethylammonium</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Grafik 2 menunjukkan pengaruh dari batrachotoxin</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Grafik 3 menunjukkan pengaruh dari tetrodotoxin</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Batrachotoxin menyebabkan peningkatan Na+ conductance pada sel saraf</span></span></span></p>','1','0','0','1',1),(30,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gambar berikut mengilustrasikan kromosom manusia no 21 (biru) dan no 14 (merah). Arah panah menunjukkan orientasi 5&rsquo;-ke-3&rsquo; pada berbagai primer PCR. Primer A adalah satu dari dua primer yang digunakan untuk mendiagnosis keberadaan translokasi Robertsonian (14q21q). Anda ditugaskan untuk memilih primer satu lagi yang dapat menghasilkan produk PCR pada individu dengan translokasi, tetapi tidak mendeteksi genom DNA tanpa translokasi.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh5.googleusercontent.com/cRzfbUmebP-0ItPSs9vJEHne_kqlOhpItcYe-wiwLg1IKBFOEahrntcAveLPLdE-_XfEntNCxd3VAHMjtBASe-GzkBF5lqxS3R5O0-l5o4rf_TYQYjy9UQLcrk2Tcivh6fkQvpY\" style=\"height:83px; width:542px\" /></span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Translokasi Robertsonian merupakan tipe non-resiprokal antara dua kromosom non-homolog telosentrik</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Primer 6 posisinya dekat dengan titik translokasi</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Translokasi Robertsonian dapat dijumpai pada sindrom Down</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Primer A dan 5 dapat digunakan untuk mendapatkan produk PCR diagnostik translokasi Robertsonian</span></span></span></p>','0','0','1','1',1),(31,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kamu seorang ahli genetik yang sedang meneliti sebuah fenotip langka mata ungu. Dua buah keluarga yang berbeda datang kepadamu dan kebetulan ada anggota keluarga mereka memilki mata ungu.</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan apakah pernyataan berikut benar (B) atau salah (S)!</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"Diagram, schematicDescription automatically generated\" src=\"https://lh3.googleusercontent.com/IH_5mXEOJkFiPRuTOPwgb6mP69E2GuBTTdAERzVXxy9OvWJwgenOckZwSsoEehVOD7xxAA4So8gEN07k__vZIjkv_UwyJ56_Z59S6kkeLjQgKD-85MkmdWR9KQF85PGzquauu1w\" style=\"height:339px; width:312px\" /></span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Fenotip langka ini disebabkan oleh autosomal resesif</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat 3 orang di keluarga Jefferson yang pasti bergenotip heterozigot</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika fenotip ini tidak langka, maka penurunan penyakit lebih mungkin oleh resesif terpaut kromosom- X</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Analisis pedigree menunjukkan adanya penetransi yang tidak sempurna dalam penurunan mata ungu</span></span></span></p>','1','1','0','0',1),(32,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat 4 orang tuli,2 pria, 2 wanita yang datang ke dokter. Sifat tuli ini diturunkan oleh 3 gen yang berbeda dan apabila terdapat gen yang homozigot pada salah satunya, maka orang tersebut akan tuli. 2 gen yang homozigot akan menyebabkan kematian pada janin dengan penetransi 25 %. Jika terdapat 3 gen yang homozigot, maka letalitas bayi adalah 75 %.&nbsp;</span></span></span></li></ol><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berikut adalah genotip dari pria dan wanita tersebut</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Wanita 1: D1d1 D2d2 d3d3</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Wanita 2: d1d1 D2D2 D3D3</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pria 1: d1d1, D2d2 D3d3</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pria 2: D1D1 D2d2 D3D3</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan apakah pernyataan berikut benar (B) atau salah (S)!</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika wanita 1 dan pria 1 menikah, maka kemungkinan anak mereka untuk sehat lebih besar dari pada anak dari wanita 2 dan pria 2</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika wanita 1 dan pria 2 menikah, kemungkinan anak mereka sehat sebesar 12,5 %</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika wanita 2 dan pria 1 menikah, kemungkinan anak mereka sakit sebesar 50 %</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika wanita 2 dan pria 2 menikah, maka tidak ada anak mereka yang tuli</span></span></span></p>','1','0','0','0',1),(33,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Seorang ahli molekuler meneliti suatu operon dengan cara mengukur ekspresi dari empat gen struktural (A, B, C, dan D) yang dihasilkan oleh wild-type dan sel bakteri mutan setelah ditambahkan senyawa Z pada medium minimal. Protein tambahan (E) berukuran sangat kecil (kurang dari 20 asam amino), dan tidak dapat diukur menggunakan sistem analitik yang digunakan untuk mengukur protein lain. Sejumlah mutasi nonsense ditemukan pada operon tersebut. Ada juga mutasi nonsense polar yang mencegah ekspresi gen downstream dari mutasi. (Sebagai contoh pada operon lac, sejumlah mutasi nonsense lacZ dapat menyebabkan tidak adanya ekspresi lacY dan lacA). Peneliti juga menemukan mutasi pada dua situs lain, F dan G, yang sangat berkaitan dengan A-D. Grafik berikut ini menunjukkan semilogaritmik. Persentase dari ekspresi maksimal untuk suatu protein diplotkan pada sumbu Y, sementara sumbu X menunjukkan waktu. Senyawa Z ditambahkan pada titik yang ditunjuk anak panah.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/5yaeOG2t7fdTCPqH1lDhNt-nErjemgaZi6HPDP8u3kCZUf_ABqt4Lagvz9gr9Ofp6edWww-saVF_bUDuCKJ6Fbd57WlGM6MjBY-fQIAjserD6jGiuODOVEO5J43VopqT8eTDMhg\" style=\"height:629px; width:445px\" /></span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Operon di atas termasuk operon repressible</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada operon nonsense pada gen A, gen C tidak diekspresikan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gen C merupakan gen struktural pertama dari operon tersebut</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Situs G kemungkinan merupakan operator dari operon</span></span></span></p>','1','0','1','0',1),(34,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tinggi dari sebuah tanaman ditentukan oleh sifat poligenik. Tanaman paling rendah memiliki tinggi 10,5 cm dan paling tinggi 19,5 cm. Jika tanaman paling tinggi dan paling rendah disilangkan dan menghasilkan F1, lalu sesama F1 disilangkan kembali maka akan ditemukan tanaman dengan tinggi 12 cm sebanyak 75 dari 800 tanaman</span></span></span></p><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan apakah pernyataan berikut benar (B) atau salah (S)!</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tinggi tanaman ini ditentukan oleh 4 gen</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika F1 disilangkan maka akan ditemukan tanaman paling banyak dengan tinggi 16 cm</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Akan ditemukan proporsi yang sama untuk tanaman dengan tinggi 12 dan 18 cm jika F1 saling disilangkan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika tanaman dengan tinggi 12 cm dan 10,5 cm disilangkan, maka persentasi anakan dengan tinggi 12 cm adalah 75 %</span></span></span></p>','0','0','1','0',1),(35,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tiga jenis jagung putih galur murni disilangkan satu sama lain. Pada semua persilangan didapatkan hasil F1 jagung merah. Kemudian F1 dalam tiap persilangakan dikawinkan dengan sesamanya. Berikut adalah hasil dari persilangannya.</span></span></span></p><p>&nbsp;</p><div style=\"margin-left:123px\"><table cellspacing=\"0\" style=\"border-collapse:collapse; border:none; width:415px\">	<tbody>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:189px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Persilangan</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:68px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">F1</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:158px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">F2</span></span></span></p>			</td>		</tr>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:189px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Putih-1 x Putih-2</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:68px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Putih</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:158px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Putih</span></span></span></p>			</td>		</tr>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:189px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Putih-1 x Putih-3</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:68px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Putih</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:158px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Putih</span></span></span></p>			</td>		</tr>		<tr>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:189px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Putih-2 x Putih-3</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:68px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Putih</span></span></span></p>			</td>			<td style=\"border-bottom:1px solid #000000; border-left:1px solid #000000; border-right:1px solid #000000; border-top:1px solid #000000; vertical-align:top; width:158px\">			<p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">163 Putih : 37 Merah</span></span></span></p>			</td>		</tr>	</tbody></table></div><p>&nbsp;</p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tentukan pernyataan berikut benar atau salah</span></span></span></p><p>&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sifat warna bunga diatur oleh minimal 3 gen</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat epistatis dominan genetik pada pengaturan sifat ini</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jika tanaman F1 Putih persilangan 1 dan 2 disilangkan dan dihasilkan 50 keturunan, sekitar 9 diantaranya akan berbunga merah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat jenis jagung Putih-4 (galur murni)</span></span></span></p>','0','0','1','0',1);
