INSERT INTO `ekonomi` VALUES (1,'<p style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Elastisitas harga permintaan bagi </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>durable goods</em></span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"> </span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">dalam jangka panjang cenderung ...</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Lebih elastis daripada elastisitas pada jangka pendek</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sama dengan elastisitas pada jangka pendek</span></span></span></p>','<p style=\"list-style-type:lower-alpha\"><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tidak terpengaruhi oleh jangka waktu</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kurang elastis daripada elastisitas jangka pendek</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Memiliki elastisitas uniter</span></span></span></p>',1,'a'),(2,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Daya monopoli dikatakan sumber dari </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>market failure</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font