INSERT INTO `geografi` VALUES (1,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Di antara tempat-tempat berikut yang secara alami memiliki potensi kejadian kekeringan meteorologis sepanjang tahun adalah:</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Sharjah, Uni Emirat Arab</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Aralsk, Kazakhstan</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Cusco, Peru</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Bordeaux, Prancis</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Darwin, Austalia</span></span></span></p>',1,'a'),(2,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Kejadian anomali iklim berupa Osilasi Selatan El Nino dan Osilasi Dipol Samudra Hindia dapat mempengaruhi kondisi cuaca dan iklim di wilayah Indonesia, terutama pembentukan hujan. Kombinasi anomali yang menyebabkan wilayah Indonesia mengalami kekeringan parah adalah:</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">El Nino (ENSO negatif) dan Dipol Hindia negatif</span></span></span></p>','<p><span style=\"color:#000000\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">El Nino (ENSO negatif) dan Dipol Hindia positif</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">La Nina (ENSO positif) dan Dipol Hindia positif</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">La Nina (ENSO positif) dan Dipol Hindia negatif</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">La Nina (ENSO positif) dan Dipol Hindia netral</span></span></span></p>',1,'b'),(3,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Presipitasi adalah unsur cuaca terpenting dalam kehidupan masyarakat di Indonesia, termasuk dalam hal klasifikasi iklim. Klasifikasi iklim yang dikembangkan khusus untuk wilayah Indonesia dengan mempertimbangkan presipitasi untuk tujuan pertanian adalah:</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Klasifikasi iklim Junghuhn</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Klasifikasi iklim Koeppen</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Klasifikasi iklim Thornthwaite</span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Klasifikasi iklim Trewartha</span></span></span></p>','<p><span style=\"color:#000000\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Klasifikasi iklim Oldemann</span></span></span></span></p>',1,'e'),(4,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Unsur cuaca dan iklim yang memiliki data yang bersifat kuantitatif adalah:</span></span></span