n></span></span></p>','<p>303 juta jiwa</p>','<p>305 juta jiwa</p>','<p>724 juta jiwa</p>','<p>876 juta jiwa</p>','<p>897 juta jiwa&nbsp;</p>',1,'b'),(51,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Perhatikan peta citra sebagian Ternate, Maluku Utara berikut ini!</span></span></span></p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">a. Apakah pola penjalaran kota <em>(urban sprawl) </em>yang dominan terjadi di Ternate?</span></span><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"> </span></span></strong></p><p>b.&nbsp;<span style=\"font-family:Calibri,sans-serif; font-size:12pt\">Sebutkan 5 jenis penggunaan lahan yang terlihat pada peta</span></p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">c. Nama dari suatu landasan bandar udara <em>(runway) </em>ditentukan oleh azimuth, misalnya salah satu <em>runway </em>bandara Soekarno Hatta dinamakan <em>runway </em>06/24 karena memiliki azimuth 60&deg; dan 240&deg; karena dapat diukur dari dua arah. Berilah nama <em>runway </em>Bandara Sultan Baabullah di Ternate sesuai aturan berikut!</span></span></p>','','','','','',0,'esai'),(52,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Perhatikan grafik Angka Kelahiran Kasar dan Angka Kematian Kasar Indonesia berikut!</span></span></span></p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">a. Deskripsikan kondisi kelahiran dan kematian di Indonesia dari tahun 1950 s.d. tahun 2010!</span></span><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"> </span></span></strong></p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">b. Berikan periodisasi transisi demografi di Indonesia berdasarkan grafik tersebut! Pada tahun berapa saja kah Indonesia mengalami tahap transisi demografi ke-1, 2, 3, 4, atau 5? </span></span></p><p>&nbsp;</p>','','','','','',0,'esai'),(53,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Indonesia saat ini mengalami fenomena migrasi internal antarwilayah yang tinggi, baik rural-urban maupun urban-urban. Beberapa kota besar seperti Jakarta dan Surabaya mengalami pertumbuhan penduduk total yang tinggi karena tingginya migrasi masuk. Sementara itu, beberapa kota kecil cenderung mengalami fenomena populasi menua <em>(aging population) </em>karena semakin banyaknya usia muda yang keluar dari kota tersebut.</span></span></span></p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">a. Sebutkan 3 hal yang menjadi faktor penarik migrasi internal di Indonesia! </span></span></p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">b.&nbsp;Sebutkan 3 hal yang menjadi faktor pendorong migrasi internal di Indonesia! </span></span></p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">c. Berdasarkan teori migrasi Everett Lee, terdapat <em>intervening obstacle </em>(penghalang antara) yang dapat mempengaruhi seseorang untuk bermigrasi. Sebutkan 2 penghalang antara yang mungkin ditemui migran internal di Indonesia!</span></span><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"> </span></span></strong></p>','','','','','',0,'esai'),(54,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Perhatikan gambar berikut!</span></span></span></p><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">a.&nbsp;</span></span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Gambar di atas menunjukkan bentuk mitigasi dari bencana&hellip; </span></span></p><p>b.&nbsp;<span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">Apa fungsi dari konstruksi yang ada pada gambar?</span></span></p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\">c. Sebutkan 5 kegunaan lain dari upaya mitigasi tersebut!</span></span><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Calibri&quot;,sans-serif\"> </span></span></strong></p>','','','','','',0,'esai'),(55,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Seorang surveyor sedang menjelajah untuk melakukan pengukuran menggunakan klinometer abney level, alat yang digunakan untuk mengukur sudut dari mata pengguna ke titik yang dibidik. Sang surveyor menggunakan alat tersebut untuk mengukur dua objek, tinggi mercusuar dan lebar sungai. Diketahui tinggi surveyor adalah 1,9 meter dan tinggi mata surveyor adalah 1,75 meter. Maka hitunglah:</span></span></span></p><ol style=\"list-style-type:lower-alpha\">	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Tinggi mercusuar, jika sudut bidikan puncak mercusuar dari mata surveyor adalah 60&deg;, jarak surveyor dengan dasar mercusuar adalah 30 meter. (sin60&deg; = 0,87; cos60&deg; = 0,5; tan60&deg; = 1,73)</span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Lebar sungai jika sudut bidikan tepi sungai dari mata surveyor adalah 5&deg;. (sin5&deg; = 0,09; cos5&deg; = 0,99; tan5&deg; = 0,09)</span></span></span></li></ol>','','','','','',0,'esai');
/*!40000 ALTER TABLE `geografi` ENABLE KEYS */;
