span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">R</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">3</span></span></span></sup></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">Gm<sub>1</sub>m<sub>2</sub>/2</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">R</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">3</span></span></span></sup></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">2Gm<sub>1</sub>m<sub>2</sub>/</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">R</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">3</span></span></span></sup></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">Gm<sub>1</sub>m<sub>2</sub>/</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">R</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">2</span></span></span></sup></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">2Gm<sub>1</sub>m<sub>2</sub>/</span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">R</span></span></span><sup><span style=\"font-size:12pt\"><span style=\"font-family:\'Cambria Math\',serif\"><span style=\"color:#000000\">2</span></span></span></sup></p>',1,'c'),(10,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Planet mars berdekatan dengan sabuk asteroid. Salah satu jenis asteroid yang memiliki kandungan bahan organik yang melimpah adalah&hellip;</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">A-type asteroid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">C-type asteroid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">S-type asteroid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">M-type asteroid</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">O-type asteroid</span></span></span></p>',2,'b'),(11,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Salah satu sumber air pada permukaan planet mars berasal dari es yang berada pada kutubnya. Salah satu mekanisme pencairan es tersebut adalah gaya gesek. Jika bongkahan es dengan massa 300 ton dan suhu -15&ordm; C mengalami longsor dan menuruni gunung mars dengan panjang lereng 80 km, tentukan massa es yang mencair pada bongkahan es tersebut (Koefisien gesek= 0,08 , Kalor jenis es= 0,5 kalori/gram&deg;C, Kalor lebur es= 80 kalori/gram&deg;C)</span></span></span></p>','','','','','',0,'essay'),(12,'<p><strong>Bacaan untuk soal nomor 12-18</strong></p><p>&nbsp;</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Megathrust, Apa Itu?</strong></span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pulau Jawa dikabarkan memiliki potensi terkena tsunami setinggi 20 meter di Selatan Pulau Jawa. Bahkan, gelombang lautan raksasa tersebut diperkirakan hanya butuh waktu selama 20 menit untuk sampai pinggir pantai. Sebenarnya, apa yang disebut sebagai zona Megathrust? Dan bagaimana dampaknya terhadap kehidupan manusia?</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Zona Megathrust sendiri didefinisikan sebagai pusat gempa yang terletak pada bidang kontak antarlempeng dengan kedalaman kurang dari 45-50 km, dimana subduksi masih berlangsung dengan sudut yang landai dan belum menukik. Gempa ini mengakibatkan gempa-gempa bumi terbesar di dunia, seperti gempa bumi di Chile pada tahun 1960 dengan magnitude 9,5, gempa di Alaska pada tahun 1964 dengan magnitude 9,2 dan gempa Aceh pada tahun 2004 dengan magnitude sebesar 9,0.&nbsp; Untuk dapat menimbulkan tsunami, sebuah gempa harus memiliki beberapa syarat yaitu kekuatan yang besar, hiposentrum yang dangkal dan pergerakan berupa sesar naik.</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Skenario yang banyak dikhawatirkan masyarakat saat ini adalah apabila lempeng segmen selatan Jawa Barat dan Banten pecah maka diprediksikan akan mengalami gempa sebesar &hellip; SR. Sedangkan apabila lempeng segmen selatan Jawa Tengah dan Timur pecah, maka diprediksikan akan mengalami gempa sebesar &hellip; SR. Dan apabila kedua segmen lempeng pecah, maka diprediksikan akan terjadi gempa sebesar &hellip; SR. Secara historis, gempa besar dengan magnitudo antara 7,0 dan 7,9 yang bersumber di zona megathrust selatan Jawa sudah terjadi sebanyak 8 kali, yaitu: tahun 1903 (M7,9), 1921 (M7,5), 1937 (M7,2), 1981 (M7,0), 1994 (M7,6), 2006 (M7,8) dan 2009 (M7,3).</span></span></span></p><p style=\"margin-left:48px\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sebenarnya, terdapat 13 zona Megathrust di Republik Indonesia. Rinciannya adalah megathrust Aceh-Andaman, Nias-Simelue, Batu, Mentawai Siberut dan Mentawai-Pagai. megathrust Enggano, Selat Sunda, Jawa Barat-Jawa Tengah, Jawa Timur, dan Sumba. Berikutnya megathrust Sulawesi Utara, Filipina, dan Papua. Intinya terdapat pada tepi benua aktif dengan aktivitas subduksi.</span></span></span></p><p><br /><img alt=\"Sumatran megathrust earthquakes: from science to saving lives |  Philosophical Transactions of the Royal Society A: Mathematical, Physical  and Engineering Sciences\" src=\"https://lh5.googleusercontent.com/4HY8-d-NkGyOF4AJLvzs1cWCPVadzyJE1qRJmHhz5Vsq1Gg9wCI7UvOdnjJp-9qQ41CEAVHRWPCy_PGvmNg_sJwmyeuemewuzmzrLq2QSWNBCIVVSGDVJWqikDLRMujkJScQfC0\" style=\"height:287px; width:247px\" /><br /><br /><br /><br /><br /><br /><br /><br />&nbsp;</p><p>&nbsp;</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Sumber Gambar:</strong></span></span></span><br /><a href=\"https://royalsocietypublishing.org/doi/10.1098/rsta.2006.1807\" style=\"text-decoration:none\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#0563c1\"><u>https://royalsocietypublishing.org/doi/10.1098/rsta.2006.1807</u></span></span></span></a><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">&nbsp;</span></span></span></p><p>&nbsp;</p><p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><img alt=\"tektonik indonesia\" src=\"https://lh4.googleusercontent.com/FAzIk3lnNob9mXNnLrFWxVaYNGv6VptIoTA8-_TJeHoCI8Op-7vGsQ05yOofpGSg8BrCJClSMX1V99FNoKi7bjxIK589dT29dE_vRJjPG-jtpcZwZ82j7bbOb3bFG70jwq6APm8\" style=\"height:315px; width:462px\" /></span></span></span></p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Sumber Gambar:</strong></span></span></span><br /><a href=\"https://www.ibnurusydy.com/mengenal-karakteristik-zona-subduksi-di-indonesia/\" style=\"text-decoration:none\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#0563c1\"><u>https://www.ibnurusydy.com/mengenal-karakteristik-zona-subduksi-di-indonesia/</u></span></span></span></a></p><p>&nbsp;</p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berdasarkan bacaan di atas, pilihlah pernyataan yang </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>tidak benar </strong></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">mengenai gempa yang terjadi pada Megathrust!</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gempa yang disebabkan oleh Megathrust disebut pula sebagai gempa </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>swarm</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gempa yang disebabkan oleh Megathrust berpotensi memiliki magnitudo di atas 8,0 hingga di atas 9,0 skala Richter</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat 13 segmen zona gempa megathrust yang letaknya bertampalan dengan batas subduksi lempeng di Indonesia</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Gempa Megathrust adalah gempa dangkal dengan kedalaman kurang dari 40-60 km.</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tsunami pada Gempa Megathrust dapat terjadi dikarenakan adanya pergerakan yang menghasilkan </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>reverse fault </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">maupun </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>thrust fault</em></span></span></span></p>',1,'a'),(13,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada belakang zona subduksi, terciptalah magmatisme yang disebabkan oleh adanya busur-busur vulkanik. Magmatisme ini tentu mengalami proses </span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>partial melting</em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">, dimana batuan dengan panas yang cukup akan mengalami pelelehan sebagian mineralnya, karena masing-masing mineral memiliki titik leleh yang berbeda-beda. Mineral yang meleleh kedua paling akhir adalah mineral yang memiliki titik leleh yang rendah, yaitu sekitar 850-900 derajat Celsius, dengan kandungan potasium yang tinggi serta bentuk mineral yang cenderung prismatik. Mineral yang termasuk dalam golongan tersebut adalah?</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kuarsa</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Ortoklas</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Biotit</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Muskovit</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pirit</span></span></span></p>',1,'b'),(14,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada zona subduksi, mungkin sekali untuk sebuah urut-urutan batuan pada kerak samudra tersingkap ke atas dan menunjukkan sejarah tektonisme daerah tersebut. Batuan tersebut merupakan campuran dari hasil subduksi dan memiliki urutan dari bawah ke atas berupa batuan beku ultrabasa, basa dan batuan sedimen berupa rijang, Apa nama dari seri ini?</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Seri Ofiolit</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Seri Bowen</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Seri Kontinyu</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pernyataan a-c benar</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pernyataan a-c salah</span></span></span></p>',1,'a'),(15,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Terdapat beberapa elemen penting untuk dapat menimbulkan tsunami, pilihlah dari pernyataan-pernyataan berikut!</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pusat gempa terjadi di dasar laut</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kedalaman gempa kurang dari 60 km</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pergerakan sesar diakibatkan oleh gaya kompresi</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tsunami dapat terjadi karena tanah longsor yang mengakibatkan terjadinya gelombang tsunami</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Semua pernyataan benar</span></span></span></p>',1,'e'),(16,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada seri ofiolit, terdapat baturijang yang berwarna merah. Baturijang berdasarkan komposisinya termasuk dalam mineral</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Karbonatan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Silikatan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sulfatan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sulfida</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Oksida</span></span></span></p>',1,'b'),(17,'<ol>	<li style=\"list-style-type:decimal\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pada kenampakan sesar, seringkali ditemukan kenampakan seperti ini. Kenampakan seperti ini apabila dalam istilah geologi struktur seringkali disebut sebagai&hellip;</span></span></span></li></ol><p><br /><img alt=\"A picture containing rock, valley, canyon, stoneDescription automatically generated\" src=\"https://lh5.googleusercontent.com/eTVCX0_ufyb4hrq8MR3SmWlmsXXO9_2HZmr1_QCtItA1W3abu1RtBSa4b0OBTAtn1sJzXFjsiuWOA6Bd355uOi9-vc1VhS8hyzYrAsvTJfWjNYKBAMnzzTxhNt8ihr8ySWDenG4\" style=\"height:294px; width:236px\" /></p><p style=\"margin-left:48px; text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#000000\"><img src=\"https://lh3.googleusercontent.com/8iMpTJi9skM3VbbFW-ieLgay3xRq81KHDBor73-rZWSTpbNBfRFj32KwvoocKUqkbO7vuNn6BYiX1GPzPLUeyQ7LebeyvjhnEoGOnUIP8BdtsHnQb5vbPyT3oXt345pXsv66fBs\" style=\"height:1px; width:1px\" /></span></span></span></p><p style=\"margin-left:48px\">&nbsp;</p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Slickenside</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Stepping</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Fault Breccia</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Horizontal Slip</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Hade</span></span></span></p>',1,'a'),(18,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berdasarkan soal nomor 6, perkirakan arah pergerakan blok sesar apabila panah ke atas pada gambar menunjukkan arah utara!</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Utara-Selatan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Barat-Timur</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tenggara-Barat Daya</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Timur Laut-Barat Laut</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Semua Jawaban Salah</span></span></span></p>',1,'b'),(19,'<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Mineral bijih dari logam-logam berat seperti tembaga, zink, timbal, emas dan perak biasanya ditemukan </span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pada batupasir dan batulanau yang terendapkan di lingkungan laut dangkal</span></span></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pada batulumpur yang terendapkan di rawa-rawa</span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Berasosiasi dengan urat hidrotermal pada batuan beku maupun terdapat di batuan metamorf</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Berasosiasi dengan kerikil-kerikil pada dasar sungai</span></span></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Berasosiasi dengan <em>strike and slip faults </em>dan peristiwa kataklastik</span></span></p>',1,'c'),(20,'<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Ciri-ciri batuan terkena<em> </em>deformasi<em> </em>di lapangan adalah</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Adanya translasi atau pergeseran posisi</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Adanya rotasi atau perubahan ke posisi yang tidak sejajar</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Adanya perubahan bentuk batuan</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Adanya perubahan volume batuan</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Jawaban a,b,c,d benar</span></span></p>',1,'e'),(21,'<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pernyataan mengenai sesar naik ini semuanya benar, kecuali</span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sesar naik mengalami peristiwa <em>shortening</em></span></span></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sesar naik memiliki bidang striasi dengan sudut 0<sup>0</sup></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sesar naik disebabkan oleh gaya kompresional</span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sesar naik yang memiliki dip lebih dari 30<sup>0 </sup>disebut <em>reverse fault</em></span></span></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sesar naik disebabkan oleh gaya <em>shearing</em></span></span></p>',1,'e'),(22,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sebuah blok kecil batuan jatuh dikarenakan oleh pelapukan dari ujung tebing yang sempit. Apabila tebing memiliki tinggi 20 m dan percepatan gravitasi dianggap 10 m/s<sub>&shy;</sub><sup>2</sup>, berapa lama waktu yang diperlukan oleh blok batuan tersebut untuk mencapai pasir pantai apabila gesekan udara dan gesekan dari pasir pantai dianggap tidak ada?</span></span></span></span></p>','','','','','',1,'essay'),(23,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sebuah perusahaan X menemukan prospek mineral pada suatu tubuh batuan yang 10% nya merupakan mineral Cu<sub>2</sub>O. Sedangkan Cu&shy;&shy;<sub>2</sub>O mengandung 88,82% berat Cu. Tubuh batuan ini diprediksikan akan memproduksi 800 ton logam campuran (<em>alloy</em>) yang mengandung 95% Cu untuk berbagai kebutuhan.</span></span></span></span></p><ol style=\"list-style-type:lower-alpha\">	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Apa nama mineral ekonomis ini?</span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Berapa massa Cu murni yang ingin diproduksi?</span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Normalisasikanlah kadar Cu dari Cu&shy;&shy;&shy;<sub>2</sub>O yang harus ada sebagai hasil kali dari massa Cu murni yang diproduksi! </span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Hitunglah massa tubuh batuan yang diperlukan untuk ditambang!</span></span></span></span></li></ol>','','','','','',1,'essay'),(24,'<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sedimen yang berasal dari sisa-sisa rangka organisme hidup yang membentuk partikel halus yang dalam istilah geologi disebut dengan &ldquo;calcareous ooze&rdquo; atau &ldquo;siliceous ooze&rdquo; termasuk dalam sedimen pelagik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Litogenik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Biogenik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Hidrogenik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kosmogenik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Limnogenik</span></span></p>',1,'b'),(25,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Dalam karakteristik umum air laut, dikenal perubahan drastis distribusi vertikal temperatur atau yang disebut dengan termoklin. Pernyataan manakah yang bersesuaian dengan termoklin di daerah lintang sedang?</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Suhu relatif sama di kedalaman 0 m maupun kedalaman 200 m, berkisar 0-5 derajat celcius</span></span></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Terdapat termoklin musiman yaitu pada saat musim panas dan musim dingin</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pada lapisan campuran, suhu relatif berada di atas 25 derajat</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Laju perubahan suhu seiring dengan kedalaman temperatur lebih cepat terjadi pada saat musim dingin</span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Terdapat <em>dicothermal layer</em>, yaitu saat temperatur air laut terendah, pada kedalaman dari 50-100 m diapit oleh lapisan campuran yang hangat dan air laut dalam yang hangat</span></span></span></span></p>',1,'b'),(26,'<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Sifat-sifat air dapat berubah apabila terjadi penambahan konsentrasi garam, pilihlah pernyataan yang salah</span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Viskositas naik</span></span></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tekanan uap turun</span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tekanan osmosis naik</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Densitas naik</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kapasitas panas jenis naik</span></span></span></span></p>',1,'e'),(27,'<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Diagram di atas menggambarkan kondisi geohidrologi bawah permukaan secara sederhana. Region A disebut sebagai</span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Unsaturated zone</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Saturated zone</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Discharge zone</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Recharge zone</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Aquiclude zone</span></span></span></span></p>',1,'a'),(28,'<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Apabila suatu gelombang pecah memiliki tinggi 1 meter dengan panjang gelombang perairan 2 meter dan sudut lereng gisik pantai 5 derajat, maka gelombang pecah ini termasuk dalam jenis</span></span></p>','<p>Surging</p>','<p>Spiliing</p>','<p>Plunging</p>','<p>Collapsing</p>','<p>Breaking</p>',1,'b'),(30,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zona pelagis dapat dibedakan menjadi dua, yaitu zona neritik dan zona oseanik. Zona oseanik memiliki berbagai lingkungan dengan karakteristik yang berbeda-beda dikarenakan penetrasi cahaya yang berbeda-beda pula. Zona ini memiliki ciri-ciri yaitu hanya menerima 1% cahaya dari seluruh cahaya yang dipenetrasikan ke lautan, dengan kedalaman 200-1000 m. Zona apakah ini?</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zona eufotik</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zona disfotik</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zona afotik</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zona abisopelagis</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zona hadal</span></span></span></span></p>',1,'b'),(31,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zona hidrotermal laut dalam adalah sebuah zona yang istimewa, karena zona ini memiliki produktivitas tinggi yang dipercaya merupakan asal usul kehidupan, dikarenakan adanya kemosintesis antara keberadaan zat-zat yang dibutuhkan untuk membentuk asam amino, yaitu metana dan amonia yang tidak ada di atmosfer bumi primitif. Apa yang terjadi bila sumber cahaya dari matahari tiba-tiba menghilang?</span></span></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Produktivitas zona ini akan menghilang dikarenakan tidak adanya cahaya matahari sebagai agen utama yang memecah ion-ion untuk menghasilkan material-material organik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zona ini akan membeku dikarenakan penurunan panas yang sangat tiba-tiba saat matahari menghilang, sehingga tidak memungkinkan mahluk hidup untuk dapat bertahan hidup</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Bakteri akan tetap bertahan hidup selama beberapa dekade dikarenakan metabolismenya yang lambat dan penyimpanan cadangan makanan yang besar, lalu mati perlahan-lahan</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kehidupan dalam lingkungan hidrotermal akan tetap berjalan seperti biasa, dikarenakan biota laut pada lingkungan ini tidak membutuhkan cahaya matahari dalam kehidupannya</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Lingkungan hidrotermal akan mengalami pendinginan dan pembekuan, namun mahluk hidup dalam lingkungan hidrotermal akan tetap bertahan hidup karena mereka resistan terhadap dingin</span></span></p>',1,'d'),(32,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pemanasan global telah menyebabkan berbagai hal, salah satunya adalah kenaikan <em>sea surface temperature </em>atau temperatur permukaan air laut. Apa saja dampak yang dapat diakibatkan oleh kenaikan SST?</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Siklon tropis akan lebih sering terjadi dikarenakan temperatur air laut lebih hangat sebagai syarat untuk membentuk &ldquo;<em>warm core</em>&rdquo;</span></span></span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Angka PDS atau &ldquo;<em>storm-dependent potential destructive index</em>&rdquo; pada siklon tropis akan meningkat sehingga badai akan semakin besar dan merusak</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Kenaikan SST akan menyebabkan air mengalami <em>thermal expansion </em>atau pengembangan karena proses pemanasan, maka volume air laut bertambah sehingga menyebabkan banjir di daerah pesisir</span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Semua pernyataan benar</span></span></span></span></p>','<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Semua pernyataan salah</span></span></span></span></p>',1,'d'),(33,'<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Anggaplah dalam sebuah lautan terdapat elemen bernama My (Mysterium) yang terikat dalam molekul garam yang lebih kompleks, dimana dijelaskan konsentrasinya pada diagram tersebut. Perbedaan konsentrasi tersebut disebabkan oleh perbedaan karakteristik air laut di Samudra Pasifik maupun Samudra Atlantik. Anggaplah sumbu x merupakan sumbu yang merepresentasikan konsentrasi ion Mysterium.</span></span></span></span></p><p>&nbsp;</p><p>&nbsp;</p><p style=\"margin-left:66px; text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><img alt=\"Graphical user interfaceDescription automatically generated\" src=\"data:image/jpeg;base64,\" style=\"height:302px; width:373px\" /></span></span></span></span></p><p>&nbsp;</p><p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Pilihlah pernyataan yang paling benar untuk menjelaskan perbedaan karakteristik air laut di Samudra Atlantik dan Pasifik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Konsentrasi ion My yang lebih tinggi pada permukaan Samudra Atlantik dikarenakan oleh sirkulasi termohalin yang membawa arus yang hangat dan bersalinitas tinggi ke Samudra Atlantik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Salinitas di Samudra Pasifik lebih tinggi dibandingkan Samudra Atlantik</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Deposisi debu dan aerosol di Samudra Pasifik lebih tinggi daripada di Samudra Atlantik.</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tingginya aktivitas hidrotermal di kedalaman 3000 m tidak menyebabkan konsentrasi ion My di Samudra Atlantik berubah</span></span></p>','<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Konsentrasi ion My yang semakin berkurang seiring dengan kedalaman tidak dipengaruhi oleh proses <em>scavenging</em>, yaitu hilangnya partikel karena terikat oleh partikel yang lain</span></span></p>',1,'a'),(34,'<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Tipe pasang surut sangat tergantung pada bilangan Formzahl. Naomi sedang melakukan pengukuran pasang surut, dan didapati nilai-nilai sebagai berikut</span></span></p><ul>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">K1= 92,1 cm</span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">O1 = 40,08 cm</span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">M2 = 200 cm</span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">S2 = 150 cm</span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">S0 = 874 cm</span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">P1 = 32</span></span></span></span></li>	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Zo = 130 cm</span></span></span></span><br />	<br />	<span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">a. Jenis pasang surut yang terjadi adalah?<br />	b.&nbsp;Berdasarkan soal 1b, tentukan MSL, HHWL dan LLWL nya</span></span></li></ul>','','','','','',1,'essay'),(35,'<p style=\"text-align:center\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><strong>Fenomena Embun Es Dieng di awal 2021</strong></span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Fenomena embun es di dataran tinggi Dieng, Kabupaten Banjarnegara, Jawa Tengah, kembali muncul, Senin (10/5/2021) pagi. Fenomena tahunan tersebut merupakan kejadian pertama pada tahun 2021. Salah seorang warga Dieng, Hasta Priyandono yang sempat mengabadikan momen tersebut mengatakan, embun es muncul di lapangan sekitar candi. &quot;Sekitar pukul 05.30 WIB, saya lihat ke lapangan rumput timur kompleks candi, yang depan kios-kios itu, embun esnya sudah lumayan tebal,&quot; kata Hasta kepada wartawan, Senin Menurut Hasta, dalam dua hari terakhir suhu udara di dataran tinggi Dieng sudah sangat dingin. &quot;Kalau kemarin saya main ke candi belum keluar esnya. Tadi subuh sudah agak tebal,&quot; ujar Hasta. Kemunculan embun es tahun ini, kata Hasta, lebih awal dari tahun-tahun sebelumnya. Biasanya embun es akan muncul antara bulan Juni hingga Agustus. Selain itu, embun es kali pertama muncul biasanya tipis. Namun, kali ini kemunculan embun es cukup tebal. Hal senada disampaikan Kepala Unit Pelaksana Teknis (UPT) Wisata Dieng Banjarnegara Sri Utami. Sri Utami mengatakan, fenomena embun es biasanya muncul Juni hingga Agustus. &quot;Ini kok lebih awal. Tapi harapannya ini menjadi magnet kunjungan wisata ke Dieng,&quot; kata dia.</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Sumber:&nbsp;</span></span></span></p><p style=\"text-align:justify\"><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">https://regional.kompas.com/read/2021/05/10/135059378/fenomena-embun-es-muncul-di-dieng-pertama-di-tahun-2021</span></span></span></p><p>&nbsp;</p><p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pernyataan yang benar mengenai titik embun adalah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Titik embun akan tercapai ketika jumlah partikel yang terkondensasi sama dengan jumlah partikel yang menguap</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Titik embun merupakan sebutan untuk temperatur ketika embun mulai terbentuk pada permukaan tanah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Peningkatan suhu titik embun akan linear dengan bertambahnya temperatur udara</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Semakin besar kandungan air pada udara, semakin besar suhu titik embun</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Semua jawaban benar</span></span></span></p>',1,'a'),(36,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Embun es dapat terbentuk akibat adanya pendinginan permukaan. Yang merupakan proses pendinginan secara adiabatik adalah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Radiasi gelombang permukaan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pengangkatan lapisan udara akibat topografi</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\"><em>Downdraft </em></span></span></span><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">dari awan pembawa hujan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Mixing akibat bergeraknya massa udara dingin pada permukaan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Percampuran akibat adanya proses turbulens</span></span></span></p>',1,'b'),(37,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Kondisi atmosfer yang mendukung terbentuknya embun es adalah</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tidak stabil absolut</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Tidak stabil kondisional</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Stabil kondisional</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Stabil absolut</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Stabilitas netral</span></span></span></p>',1,'d'),(38,'<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Berikut adalah Faktor-faktor yang dapat mempengaruhi ukuran butir hujan , kecuali</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Ukuran butir hujan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Ketebalan kolom awan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Pergerakan vertikal dalam awan</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Jumlah uap air</span></span></span></p>','<p><span style=\"font-size:12pt\"><span style=\"font-family:\'Times New Roman\'\"><span style=\"color:#000000\">Intensitas radiasi matahari</span></span></span></p>',1,'e'),(39,'<ol>	<li style=\"list-style-type:decimal\"><span