://i.ibb.co/d5gGnd7/mat16.jpg\" style=\"height:142px; width:749px\" /></p>','','','','','',1,'essay'),(17,'<p><img alt=\"\" src=\"https://i.ibb.co/cCM6ygm/mat17.jpg\" style=\"height:260px; width:927px\" /></p>','','','','','',1,'essay'),(18,'<p><img alt=\"\" src=\"https://i.ibb.co/NFtdm5q/mat18.jpg\" /></p>','','','','','',1,'essay'),(19,'<p><img alt=\"\" src=\"https://i.ibb.co/THBpWgQ/mat19.jpg\" style=\"height:90px; width:929px\" /></p>','','','','','',1,'essay'),(20,'<p><img alt=\"\" src=\"https://i.ibb.co/JRF37Cf/mat20.jpg\" style=\"height:156px; width:858px\" /></p>','','','','','',1,'essay'),(40,'<p style=\"margin-left:48px\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><em><u>Berikut merupakan deskripsi untuk nomor 40.</u></em></strong></span></span></p><p style=\"margin-left:48px\">&nbsp;</p><table style=\"width:100%\">	<tbody>		<tr>			<td>			<div>			<p><span style=\"font-family:Consolas\">#include &lt;iostream&gt;</span></p>			<p><span style=\"font-family:Consolas\">using namespace std;</span></p>			<p>&nbsp;</p>			<p><span style=\"font-family:Consolas\">const int N = 15;</span></p>			<p><span style=\"font-family:Consolas\">int a[N] = {2, 2, 3, 1, 10, 4, 12, 3, 0, 7, 12, 12, 7, 10, 6};</span></p>			<p>&nbsp;</p>			<p><span style=\"font-family:Consolas\">int main() {</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; int data[N];</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; for (int num = 1; num &lt;= N; num++) {</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; int temp = a[num - 1];</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; bool done = false;</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; while (!done) {</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if (data[temp] == 0) {</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; data[temp] = num;</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; done = true;</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; else temp = (temp + 1) % N;</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; for (int i=0; i&lt;N; i++) {</span></p>			<p><span style=\"font-family:Consolas\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; if (i &gt; 0) cout &lt;&lt; &lsquo; &lsquo;;</span></p>			<p style=\"margin-left:48px\"><span style=\"font-family:Consolas\">cout &lt;&lt; data[i];</span></p>			<p><span style=\"font-family:Consolas\">}</span></p>			<p><span style=\"font-family:Consolas\">}</span></p>			</div>			</td>		</tr>	</tbody></table><p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Apabila array data diinisialisasi dengan nilai 0, maka output dari potongan program tersebut adalah &hellip;. <strong><em>{tulis jawaban sesuai dengan output/keluaran yang dihasilkan}</em></strong></span></span></p>','','','','','',1,'9 4 1 2 3 6 8 10 13 14 5 15 7 11 12');
