INSERT INTO `ujicoba` VALUES (1,'<p>Dira dan Deri adalah teman satu kelas di SMA BNA. Setiap hari mereka berangkat ke sekolah bersama, karena jarak rumah mereka tidak terlalu jauh. Mereka cukup akrab dan dekat, dan banyak melakukan kegiatan bersama. Selain berangkat ke sekolah bersama, mereka juga selalu pergi ke kantin bersama saat istirahat, selalu 1 kelompok dalam tugas kelompok di kelas, dan pada akhir pekan mereka sering pergi keluar bersama. Pertanyaannya, apakah hubungan mereka?&nbsp;</p>','<p>Teman biasa</p>','<p>Sahabat</p>','<p>Keluarga</p>','<p>Teman tapi mesra</p>','<p>Hubungan tanpa status</p>',1,'b'),(2,'<p>Ternyata, Dira dan Deri adalah sahabat dekat, tidak lebih dan tidak kurang. Meskipun menurut pembuat soal, tidak ada hubungan pertemanan antara laki-laki dan perempuan yang hanya sebatas teman, mungkin salah satunya punya perasaan, atau keduanya saling memiliki perasaan. Oke, lanjut ke soal selanjutnya. Setelah lulus dari bangku SMA, Dira dan Deri melanjutkan studinya ke kampus yang berbeda dan mereka dengan berat hati harus berpisah. Waktu berlalu dengan cepat, mereka kini sudah ada di tingkat akhir kuliah, dan mulai memikirkan masa depan seperti pekerjaan, keluarga, teman, dan juga pasangan. Diketahui belakangan ini Deri dekat dengan seseorang, bernama Dita. Pembuat soal punya pertanyaan, apa kira kira yang akan dilakukan Deri tentang hubungannya dengan Dita?</p>','<p>Tembak, jadian</p>','<p>Tahan, mungkin cuma perasaan sesaat</p>','<p>Sabar, persiapkan dulu diri mu untuk masa depan</p>','<p>Coba ungkapkan perlahan</p>','<p>Jadi sahabat saja</p>',1,'c'),(3,'<p>Di belahan dunia lainnya, terdapat tokoh bernama Maul dan Sari. Berapakah 2 ditambah 2?</p>','','','','','',1,''),(4,'<p>Berapa lama tokoh Senku dalam anime Dr. Stone mengalami petrifikasi?</p>','','','','','',1,''),(5,'<p>Bagaimana kabarmu hari ini? coba ceritakan apapun yang ingin kamu ceritakan, boleh tentang sekolahmu, teman temanmu, atau mungkin ingin berbagi kisah kisah menarik lainnya?</p>','','','','','',1,'essay');
/*!40000 ALTER TABLE `ujicoba` ENABLE KEYS */;
